INSERT INTO `Locations` (`LocationID`, `NameLocation`, `TypeLocation`, `City`, `Country`, `Price`, `Description`, `Morning`, `Afternoon`, `Evening`, `LocationImage`) VALUES
(101, 'Lone Pine Koala Sanctuary', 'landmark', 'Brisbane', 'Australia', 32, 'Lone Pine Koala Sanctuary is an 18-hectare (44-acre) Koala Sanctuary in the Brisbane suburb of Fig Tree Pocket in Queensland, Australia. Founded in 1927, it is the worlds first and largest koala sanctuary with over 130 koalas. Hold a koala anytime, hand feed kangaroos and meet a large variety of Australian wildlife in beautiful, natural settings.', 1, 1, 0, NULL),
(102, 'City Botanic Gardens', 'cultural', 'Brisbane', 'Australia', 50, 'The City Botanic Gardens (formerly the Brisbane Botanic Gardens) is a heritage-listed botanic garden on Alice Street, Brisbane City, City of Brisbane, Queensland, Australia. It was also known as Queens Park. It is located on Gardens Point in the Brisbane CBD and is bordered by the Brisbane River, Alice Street, George Street, Parliament House and Queensland University of Technologys Gardens Point campus. The Gardens include Brisbanes most mature gardens, with many rare and unusual botanic species. In particular the Gardens feature a special collection of cycads, palms, figs and bamboo.', 1, 1, 1, NULL),
(103, 'Wheel of Brisbane', 'landmark', 'Brisbane', 'Australia', 20, 'The Wheel of Brisbane is a Bussink R60 transportable Ferris wheel installation in Brisbane, Queensland, Australia. It is almost 60 metres (197 ft) tall. It was erected in 2008 at the northern entrance to South Bank Parklands, the transformed World Expo 88 site by the Brisbane River, as part of the 20th anniversary of World Expo 88 and the 150th anniversary of the State of Queensland 18592009 celebrations. Its August opening coincided with the annual Riverfire event. Each of the 42 air-conditioned capsules can seat up to six adults and two children providing a total passenger capacity of 336. The ride lasts for approximately 12 minutes and provides 360 views across the city.', 1, 1, 1, NULL),
(104, 'Queensland Art Gallery', 'artistic', 'Brisbane', 'Australia', 35, 'The Queensland Art Gallery (QAG) is an art museum located in the South Bank precinct of Brisbane, Queensland, Australia. The gallery is part of the Queensland Cultural Centre. It complements the Gallery of Modern Art (GOMA) building, situated only 150 metres away. The Queensland Art Gallery is owned and operated by the Government of Queensland, which created the institution in 1895 as the Queensland National Art Gallery.', 1, 1, 0, NULL),
(105, 'Museum of Brisbane', 'historical', 'Brisbane', 'Australia', 25, 'Museum of Brisbane is part of the living history of the city, examining how Brisbane and its people continue to change over time and revealing how each of our individual and collective stories are the milestones of the citys evolution. The Museum explores the seemingly ordinary people and places of Brisbane to uncover unexpected and fascinating stories and delivers a changing program of exhibitions that provoke discussion and thought about the city and its communities.', 1, 1, 0, NULL),
(106, 'Portside Wharf', 'industrial', 'Brisbane', 'Australia', 15, 'Portside Wharf is the international cruise terminal, residential and retail development at Hamilton, Brisbane, Queensland, Australia. The Wharf is Brisbanes commercial international cruise terminal. It is also an upscale residential and retail precinct including restaurants, shops, a large fish shop/cafe, a supermarket, Dendy cinema complex and a public plaza. The precinct is commonly filled with tourists who arrive by ship, in addition to locals who often arrive by CityCat.', 1, 1, 1, NULL),
(107, 'Workshops Rail Museum', 'historical', 'Brisbane', 'Australia', 21, 'The Workshops, as it is affectionately known, is a site that is steeped in history. The very first train to run in Queensland steamed from here to Bigges Camp, now Grandchester, over 145 years ago. For decades the site was the centre of rail construction, maintenance and technology for Queenslands burgeoning rail industry. In its time over 200 steam locomotives were constructed here. Thousands of workers have called The Workshops their home over the years. During its peak in WWII, over 3,000 people worked on site, making it the States largest employer at that time.', 1, 1, 0, NULL),
(108, 'Musgrave Park', 'cultural', 'Brisbane', 'Australia', 10, 'Musgrave Park is a park in South Brisbane, Queensland, Australia. The park is bordered by Edmonstone, Russell, and Cordelia Streets, and Brisbane State High School, and has an area of 63,225 m2. The park is of cultural significance to indigenous Australians.', 1, 1, 1, NULL),
(109, 'The Old Windmill', 'landmark', 'Brisbane', 'Australia', 0, 'The Old Windmill is a heirtage-listed tower located in Wickham Park, on Wickham Terrace in Spring Hill, Brisbane, Queensland, Australia. It is the oldest surviving building in Queensland.', 1, 1, 0, NULL),
(110, 'Mount Glorious', 'nature', 'Brisbane', 'Australia', 0, 'Mount Glorious is Queensland is a mountain which is part of the DAguilar Range and is a suburb in Moreton Bay Region roughly 30 km north west of Brisbane. Five blocks on the mountain were made available early in the 20th century, with the first block being bought by James OHara in 1903. The forest that surrounds the mountain village is part of Brisbane Forest Park and the the DAguilar National Park. Other mountains in the DAguilar Range include Mount Nebo, Mount Pleasant and Mount Mee. The peak is approximately 599 m above sea level. The mountain was the centre of a 4.4 magnitude earthquake in November 1960.', 1, 1, 0, NULL),
(111, 'Glass House Mountains National Park', 'nature', 'Brisbane', 'Australia', 13.8, 'Glass House Mountains National Park is a heritage-listed national park at Glass House Mountains, Sunshine Coast Region, Queensland, Australia. It is also known as Beerburrum Forest Reserve 1. It is 70 km (43 mi) north of Brisbane and consists of a flat plain punctuated by rhyolite and trachyte volcanic plugs, the cores of extinct volcanoes that formed 27 million to 26 million years ago. The mountains would once have had pyroclastic exteriors, byt these have eroded away. the national park was established in 1994. On 23 June 2010 the Queensland Government announced the expansion of the park to include an additional 2,117 hectares. It was added to the Queensland Heritage Register on 3 May 2007.', 1, 1, 0, NULL),
(112, 'St Johns Cathedral', 'landmark', 'Brisbane', 'Australia', 0, 'St Johns Cathedral is the Anglican cathedral of Brisbane and the metropolitan cathedral of the ecclesiastical province of Queensland, Australia. The cathedral is situated in Ann Street in the Birsbane central business district, and is the successor to an earlier pro-cathedral, which occupied part of the contemporary Queens Gardens on william Street, from 1854 to 1904. The cathedral is the second oldest Anglican church in Brisbane, predated only by the extant All Saints church on Wickham Terrace (1862). The cathedral is listed on the Queensland Heritage Register.', 1, 1, 0, NULL),
(113, 'Treasury Casio & Hotel Brisbane', 'entertainment', 'Brisbane', 'Australia', 100, 'Gambling and high-ceilinger rooms in a converted government building with 5 retaurants and 4 bars.', 1, 1, 1, NULL),
(114, 'Cleveland Point Light', 'landmark', 'Brisbane', 'Australia', 0, 'Cleveland Point Light, also known as Point Cleveland Light, is a lighthouse located on the north-eastern tip of Cleveland Point, at Cleveland, a suburb approximately 25 kilometres (166 mi) east-south-east of Brisbane, Australia. It overlooks Moreton Bay to the east and Raby Bay to the west. The old lighthouse was established in 1864-1865 as a wooden hexagonal tower. It is one of only two surviving lighthouses of this form, the other being Old Burnett Heads Light. A newer light, constructed of a concrete post, replaced it in 1976, and the old lighthouse was relocated a short distance away, where it stands today. The newer light was removed in 2009.', 1, 1, 0, NULL),
(115, 'Newstead House', 'historical', 'Brisbane', 'Australia', 0, 'Newstead House is Brisbanes oldest surviving residence and is located on the Breakfast Creek bank of the Brisbane River, in the northern Brisbane suburb of Newstead, in Queensland, Australia. Built as a small cottage in the Colonial-Georgian style in 1846, the cottage was extended and today is painted and furnished in a late Victorian style.', 1, 1, 0, NULL),
(116, 'Melbourne Zoo', 'nature', 'Melbourne', 'Australia', 24, 'The Royal Melbourne Zoological Gardens, commonly known as the Melbourne Zoo, contains more than 320 animal species from Australia and around the world. The zoo is 4 kilometres (2.5 mi) north of the centre of Melbourne. It is accessible via Royal Park station on the Upfield railway line, and is also accessible via tram routes 55 and 19, as well as by bicycle on the Capital City Trail. Bicycles are not allowed inside the zoo itself. The Royal Melbourne Zoological Gardens is a full institutional member of the Zoo and Aquarium Association (ZAA) and the World Association of Zoos and Aquariums (WAZA).', 1, 1, 0, NULL),
(117, 'Sea Life Melbourne Aquarium', 'scientific', 'Melbourne', 'Australia', 31, 'Sea Life Melbourne Aquarium is a Southern Ocean and Antarctic aquarium in central Melbourne, Australia. It is located on the banks of the Yarra River beside and under the Flinders Street Viaduct and the King Street Bridge. The attraction is a Sea Life Centre owned by Merlin Entertainments.', 1, 1, 0, NULL),
(118, 'National Gallery of Victoria', 'artistic', 'Melbourne', 'Australia', 28.85, 'The National Gallery of Victoria, popularly known as the NGV, is an art museum in Melbourne, Australia. Founded in 1861, it is Australias oldest, largest and most visited art museum. The National Gallery of Victoria houses an encyclopedic art collection across two sites: NGV International, located on St Kilda Road in the Melbourne Arts Precinct of Southbank, and the Ian Potter Centre: NGV Australia, located nearby at Federation Square. The St Kilda Road building, designed by Sir Roy Grounds, opened in 1968, and was redeveloped by Mario Bellini before reopening in 2003. It houses the gallerys international art collection and is on the Victorian Heritage Register. Designed by Lab Architecture Studio, the Ian Potter Centre opened in 2002 and houses the gallerys Australian art collection.', 1, 1, 0, NULL),
(119, 'Royal Botanic Gardens', 'landmark', 'Melbourne', 'Australia', 30.5, 'The Royal Botanic Gardens Melbourne are internationally renowned botanical gardens located near the centre of Melbourne, Victoria, Australia, on the south bank of the Yarra River. They are 38 hectares (94 acres) of landscaped gardens consisting of a mix of native and exotic vegetation including over 10,000 individual species. The Royal Botanic Gardens have a second division in the outer Melbourne suburb of Cranbourne, some 45 km south-east of the city. The 363 hectare (897 acres) Royal Botanic Gardens, Cranbourne have a focus solely on Australian native plants, and feature an award-winning special section called the Australian Garden, which was opened in May 2006.', 1, 1, 1, NULL),
(120, 'Eureka Tower', 'industrial', 'Melbourne', 'Australia', 20.5, 'Eureka Tower is a 297.3-metre (975 ft) skyscraper located in the Southbank precinct of Melbourne, Victoria, Australia. Construction began in August 2002 and the exterior completed on 1 June 2006. The plaza was finished in June 2006 and the building was officially opened on 11 October 2006. The project was designed by Melbourne architectural firm Fender Katsalidis Architects and was built by Grocon (Grollo Australia). The developer of the tower was Eureka Tower Pty Ltd, a joint venture consisting of Daniel Grollo (Grocon), investor Tab Fried and one of the Towers architects Nonda Katsalidis. It was the worlds tallest residential tower when measured to its highest floor, until surpassed by Ocean Heights and the HHHR Tower in Dubai. It is the second tallest building in Australia, behind Q1, Queensland, and is the tallest to roof (excluding spire). As of 2016 it is the 15th tallest residential building in the world.', 1, 1, 1, NULL),
(121, 'Flagstaff Gardens', 'landmark', 'Melbourne', 'Australia', 25, 'Flagstaff Gardens is the oldest park in Melbourne, Victoria, Australia, first established in 1862. Today it is one of the most visited and widely used parks in the city by nearby office workers and tourists. The gardens are notable for their archeological, horticultural, historical and social significance to the history of Melbourne. The gardens are 7.2 hectares (18 acres) of Crown Land bounded by William, La Trobe, King and Dudley streets, managed by the City of Melbourne. On the southeast corner opposite is the entrance to Flagstaff railway station. Diagonally opposite stands the Victorian branch of the Royal Mint, established 7 August 1869. The former Royal Mint building is a well-preserved example of Victorian Gold Rush boom-period classical styled architecture. The facade features paired columns with scrolled capitals and the Royal Mint coat-of-arms.', 1, 1, 1, NULL),
(122, 'Queen Victoria Market', 'cultural', 'Melbourne', 'Australia', 10.5, 'The Queen Victoria Market (also known as the Queen Vic Markets or the Queen Vic, and locally as Vic Market) is a major landmark in Melbourne, Australia, and at around seven hectares (17 acres) is the largest open air market in the Southern Hemisphere. The Market is significant to Melbournes culture and heritage and has been listed on the Victorian Heritage Register. The Market is not named after Queen Victoria, but instead gets its name from its location on the corner of Queen and Victoria Streets, Melbourne.', 1, 1, 0, NULL),
(123, 'Melbourne Star', 'landmark', 'Melbourne', 'Australia', 32.4, 'The Melbourne Star (previously Southern Star) is a giant Ferris wheel in the Waterfront City precinct in the Docklands area of Melbourne, the state capital of Victoria, Australia. Described by its operators as the Southern Hemispheres only giant observation wheel, it is 120 m (394 ft) tall and has seven spokes, reflecting the seven-pointed star of the Australian flag.', 0, 1, 1, NULL),
(124, 'Federation Square', 'landmark', 'Melbourne', 'Australia', 0, 'Federation Square is a mixed-use development in the inner city of Melbourne, covering an area of 3.2 hectares and centred on two major public spaces: open squares (St. Pauls Court and The Square) and one covered (The Atrium), built on top of a concrete deck above busy railway lines. It is located at intersection between Flinders Street and Swanston Street/St Kilda Road in Melbournes Central Business District, adjacent to Melbournes busiest railway station.', 1, 1, 1, NULL),
(125, 'Australian Centre for the Moving Image', 'artistic', 'Melbourne', 'Australia', 31.5, 'The Australian Centre for the Moving Image (ACMI) is a state-of-the-art facility purpose-built for the preservation, exhibition and promotion of Victorian, Australian and International screen content in all forms.[1] It is located in Federation Square, in Melbourne, Australia. During the 2013-14 financial year, 1.3 million people visited the ACMI, the second-highest attendance of any gallery or museum in Australia, with only the nearby National Gallery of Victoria attracting more, but with two sites.', 1, 1, 1, NULL),
(126, 'Yarra Valley', 'nature', 'Melbourne', 'Australia', 0, 'The Yarra Valley is the name given to the region surrounding the Yarra River in Victoria, Australia. The river originates approximately 90 kilometres east of the Melbourne central business district and flows towards it and out into Port Phillip Bay. The name Yarra Valley is used in reference to the upper regions surrounding the Yarra River and generally does not encompass the lower regions including the city and suburban areas, where the topography flattens out, or the upper reaches which are in inaccessible bushland. Included in the Yarra Valley is the sub-region of Upper Yarra (or the Upper Yarra Valley) which encompasses the towns of the former Shire of Upper Yarra in the catchment area upstream of and including Woori Yallock. The Yarra Valley is a popular day-trip and tourist area, featuring a range of natural features and agricultural produce, as well as the Lilydale to Warburton Rail Trail.', 1, 1, 1, NULL),
(127, 'State Library of Victoria', 'landmark', 'Melbourne', 'Australia', 15.5, 'The State Library of Victoria is the central library of the state of Victoria, Australia, located in Melbourne. It is on the block bounded by Swanston, La Trobe, Russell, and Little Lonsdale streets, in the northern centre of the central business district. The library holds over 2 million books and 16,000 serials, including the diaries of the cities founders, John Batman and John Pascoe Fawkner, and the folios of Captain James Cook, R.N.. It also houses the original armour of Ned Kelly.', 1, 1, 0, NULL),
(128, 'Crown Melbourne', 'entertainment', 'Melbourne', 'Australia', 0, 'Crown Melbourne is a casino and resort located on the south bank of the Yarra River, in Melbourne, Australia. Crown Casino is a unit of Crown Limited. Crowns casino complex opened in 1997, after moving from a temporary location that opened in 1994 and was on north bank of the Yarra. It is one of the central features of the Southbank area in the central business district and the Crown Promenade fronts onto the waterfront as part of Southbank Promenade. Children under 18 are permitted into the entertainment and shopping section of complex, but not into the gaming area or areas serving alcohol. The entire complex has a space of 510,000 m which is equivalent to two city blocks, making it the largest casino complex in the Southern Hemisphere and one of the largest in the world.', 1, 1, 1, NULL),
(129, 'The Arts Centre', 'artistic', 'Melbourne', 'Australia', 24.5, 'The Arts Centre Melbourne, originally known as the Victorian Arts Centre and briefly officially called the Arts Centre, is a performing arts centre consisting of a complex of theatres and concert halls in the Melbourne Arts Precinct, located in the central Melbourne suburb of Southbank in Victoria, Australia. It was designed by architect Sir Roy Grounds, the masterplan for the complex (along with the National Gallery of Victoria) was approved in 1960 and construction began in 1973 following some delays. The complex opened in stages, with Hamer Hall opening in 1982 and the Theatres Building opening in 1984.', 1, 1, 1, NULL),
(130, 'Sydney Opera House', 'artistic', 'Sydney', 'Australia', 65.5, 'The Sydney Opera House is a multi-venue performing arts centre in Sydney, Australia. It is one of the 20th centurys most famous and distinctive buildings. Designed by Danish architect Jrn Utzon, the building was formally opened on 20 October 1973 after a gestation beginning with Utzons 1957 selection as winner of an international design competition. The government of New South Wales, led by the premier, Joseph Cahill, authorised work to begin in 1958 with Utzon directing construction. The governments decision to build Utzons design is often overshadowed by circumstances that followed, including cost and scheduling overruns as well as the architects ultimate resignation.', 1, 1, 1, NULL),
(131, 'Darling Harbour', 'industrial', 'Sydney', 'Australia', 0, 'Darling Harbour is a harbour adjacent to the city centre of Sydney, New South Wales, Australia. It is also a large recreational and pedestrian precinct that is situated on western outskirts of the Sydney central business district. Originally Long Cove, the locality extends northwards from Chinatown, along both sides of Cockle Bay to Darling Harbour wharf on the east, and to the suburb of Pyrmont on the west. Cockle Bay is just one of the waterways that makes up Darling Harbour, which opens north into the much larger Port Jackson.', 1, 1, 1, NULL),
(132, 'Sydney Tower', 'industrial', 'Sydney', 'Australia', 0, 'Sydney Tower is Sydneys tallest structure and the second tallest observation tower in the Southern Hemisphere. Aucklands Sky Tower is taller but Sydney Towers main observation deck is almost 50 m (164 ft) higher than the observation deck on Aucklands Sky Tower. The name Sydney Tower has become common in daily usage, however the tower has been known as the Sydney Tower Eye,  AMP Tower, Westfield Centrepoint Tower, Centrepoint Tower or just Centrepoint. The Sydney Tower is a member of the World Federation of Great Towers.', 1, 1, 0, NULL),
(133, 'Sydney Observatory', 'scientific', 'Sydney', 'Australia', 0, 'Sydney Observatory is located on a hill now known as Observatory Hill in the centre of Sydney. The site evolved from a fort built on Windmill Hill in the early 19th century to an astronomical observatory during the nineteenth century. It is now a working museum where evening visitors can observe the stars and planets through a modern 40 cm Schmidt-Cassegrain telescope and a historic 29 cm refractor telescope built in 1874, the oldest telescope in Australia in regular use.', 1, 1, 1, NULL),
(134, 'Featherdale Wildlife Park', 'nature', 'Sydney', 'Australia', 63, 'Featherdale Wildlife Park is an Australian zoo in Doonside, Sydney, near Blacktown. It specialises in Australian native wildlife and birds, as well as reptiles and marsupials. It is owned currently by the Elanor Investment Group, who own several destinations in the tourism and leisure sector. The facualty is equipped with an amphitheatre, and runs a program called The Learning Burrow, encouraging education and general information on animals. The park is a major tourist attraction, not just for Western Sydney, but for NSW and Australia.', 1, 1, 0, NULL),
(135, 'Capitol Theatre', 'artistic', 'Sydney', 'Australia', 55.85, 'Capitol Theatre is a historic theatre located at 13 Campbell Street, Haymarket, Sydney, Australia. In May 2009, Capitol Theatre Management Pty Limited became a wholly owned subsidiary of Foundation Entertainment Group Limited. Foundation Entertainment Group Pty Limited owns the Sydney Lyric and Capitol Theatre.', 1, 1, 0, NULL),
(136, 'Taronga Zoo', 'nature', 'Sydney', 'Australia', 42, 'Taronga Zoo is the city zoo of Sydney, New South Wales, Australia and is located on the shores of Sydney Harbour in the suburb of Mosman. It was officially opened on 7 October 1916. Taronga Zoo is managed by the Zoological Parks Board of New South Wales, under the trading name Taronga Conservation Society, along with its sister zoo, the Taronga Western Plains Zoo in Dubbo. Divided into eight zoogeographic regions, the 21-hectare (52-acre) Taronga Zoo is home to over 4,000 animals of 340 species. It has a zoo shop, a cafe, and information centre.', 1, 1, 0, NULL),
(137, 'Wild Life Sydney', 'nature', 'Sydney', 'Australia', 70, 'Wild Life Sydney Zoo (formerly Sydney Wildlife World) is a wildlife park in the heart of the city of Sydney, Australia. Officially opened in September 2006, it is located on the city side of the Darling Harbour leisure and retail precinct, next to Sydney Aquarium and Madame Tussauds Sydney.', 1, 1, 0, NULL),
(138, 'Sea Life Sydney Aquarium', 'nature', 'Sydney', 'Australia', 60, 'SEA LIFE Sydney Aquarium (formerly Sydney Aquarium) contains a large variety of Australian aquatic life, displaying more than 700 species comprising more than 13,000 individual fish and other sea and water creatures from most of Australias water habitats. Additionally, the aquarium features 14 themed zones including Jurassic Seas, Discovery Rockpool, Shark Walk, and the worlds largest Great Barrier Reef display. Along the way, visitors encounter animals unique to each habitat, including two of only five dugongs on display in the world, sharks, stingrays, penguins and tropical fish, among others. It is a public aquarium located in the city of Sydney, New South Wales, Australia. It is located on the eastern (city) side of Darling Harbour to the north of the Pyrmont Bridge. It is a full institutional member of the Zoo and Aquarium Association (ZAA) and the World Association of Zoos and Aquariums (WAZA).', 1, 1, 1, NULL),
(139, 'Museum of Sydney', 'nature', 'Sydney', 'Australia', 58.5, 'The Museum of Sydney is a historical collection and exhibit, built on the ruins of the house of New South Wales first Governor, Arthur Phillip, on the present-day corner of Phillip and Bridge Street, Sydney. The original house, which was Australias first Government House, was built in 1788 and later abandoned. The foundations were exposed by archaeologists in 1983. The new museum building on the site was designed by Denton Corker Marshall architects. The museum was built as part of the Governor Phillip Tower development and is managed by the Historic Houses Trust of New South Wales. The Museum of Sydney explores colonial and contemporary Sydney through objects, pictures and new digital media techniques. Panoramic views of Sydneyfrom 1788 until todaystretch across walls and video screens. Sydneys convict era is explored in a giant showcase of goods and chattels recovered from more than 25 archaeological digs.', 1, 1, 0, NULL),
(140, 'Archibald Fountain', 'landmark', 'Sydney', 'Australia', 0, 'The Archibald Fountain, properly called the J. F. Archibald Memorial Fountain is located in Hyde Park, in central Sydney, New South Wales. It is named after J. F. Archibald, owner and editor of The Bulletin magazine, who bequeathed funds to have it built. Archibald specified that it must be designed by a French artist, both because of his great love of French culture and to commemorate the association of Australia and France in World War I. He wished Sydney to aspire to Parisian civic design and ornamentation. The artist chosen was Franois-Lon Sicard, who completed it in Paris in 1926 but never saw the sculpture be placed in Sydney, where it was unveiled on 14 March 1932 by the Lord Mayor of Sydney, Samuel Walder.', 1, 1, 1, NULL),
(141, 'The Domain', 'entertainment', 'Sydney', 'Australia', 24, 'The Domain is 34 hectares of open space in Sydney, New South Wales, Australia. It is located on the eastern edge of the Sydney central business district, near Woolloomooloo. The Domain adjoins the Royal Botanic Gardens and is managed by the Royal Botanic Gardens Trust, a division of the Office of Environment and Heritage. It is a popular venue for outdoor concerts, open-air events, large political gatherings and rallies and is used daily by the people of Sydney for exercise and relaxation.', 1, 1, 0, NULL),
(142, 'Sydney Olympic Park', 'entertainment', 'Sydney', 'Australia', 36, 'Sydney Olympic Park is a large sporting, cultural and leisure complex in western Sydney. It is also an official suburb of Sydney, commonly known as Olympic Park but officially named Sydney Olympic Park. Sydney Olympic Park is located 16 kilometres west of the Sydney central business district, in the local government area of City of Parramatta. The area was redeveloped for the 2000 Olympics. The facilities built continue to be used for sporting and cultural events, including the Sydney Royal Easter Show, Sydney Festival, Stereosonic, Big Day Out, Soundwave, Sydney 500 and a number of world-class sporting fixtures. The suburb also contains commercial development and extensive parklands. The area was originally part of the suburb of Homebush Bay, but was designated a suburb in its own right in 2009.', 1, 1, 0, NULL),
(143, 'Sydney Harbour National Park', 'landmark', 'Sydney', 'Australia', 68.85, 'The Sydney Harbour National Park is a protected national park comprising parts of Sydney Harbour, its foreshores and various islands. The 392-hectare (970-acre) national park lies within the Sydney metropolitan area and was created progressively, from 1975. The national park protects the landforms of Bradleys Head, Clark Island, Dobroyd Head, Fort Denison, Georges Head, Goat Island, Middle Head, Nielsen Park, Rodd Island, Shark Island, Sydney Heads including the Quarantine Station at North Head and The Gap bluff at South Head. The national park also protects the waterway between North Head and Dobroyd Head, defined as the North Sydney Harbour Aquatic Reserve. Parts of the national park lie outside the harbour and face the Tasman Sea. The national park is managed by the NSW National Parks and Wildlife Service.', 1, 1, 1, NULL),
(144, 'Roma Street Parkland', 'themepark', 'Brisbane', 'Australia', 10, 'Roma Street Parkland covers 16 hectares in the centre of Brisbane, Australia. The Roma Street Parkland is adjacent to Brisbane Transit Centre and the Roma Street Station. There is pedestrian access to the Roma Street Parkland from the Roma Street Station, as well as from Albert Street, and from the section of the Parkland which used to be called Albert Park, in Wickham Terrace.', 1, 1, 1, NULL),
(145, 'Rocks Riverside Park', 'themepark', 'Brisbane', 'Australia', 8.5, 'Rocks Riverside Park is a park by the Brisbane River in outer south-west Brisbane, Queensland, Australia. The park was opened on 7 December 2003, and features industrial artefacts from its previous use by the Queensland Cement and Lime Company. Public art which draws upon the parks industrial heritage are also featured throughout, as is a crop patch which reflects the sites farming days. Rocks Riverside Park is the largest riverfront park in Brisbane. It has 800 metres of riverfrontage and covers an area of 26 hectare. The park is nestled in amongst other industrial sites at 5 Counihan Road, Seventeen Mile Rocks in Brisbane, Australia.', 1, 1, 1, NULL),
(146, 'Yarra Bend Park', 'themepark', 'Melbourne', 'Australia', 15.05, 'Yarra Bend Park is a 260 hectare (642 acre) park in the Melbourne suburb of Kew. Located 4 km northeast of Melbournes CBD, it is the largest area of natural bushland left in inner Melbourne. The most notable feature of the park is the Yarra River which flows for 12 km through it. The park hosts two golf courses, two historic boathouses, sheds and a number of cycle and walking trails. It receives approximately 1.5 million visitors per year.', 1, 1, 1, NULL),
(147, 'Dandenong Ranges National Park', 'themepark', 'Melbourne', 'Australia', 15, 'The Dandenong Ranges National Park is a national park located in the Greater Melbourne region of Victoria, Australia. The 35,400-hectare (87,000-acre) national park is situated from 31 kilometres (19 mi) at its western most points at Ferntree Gully and Boronia to 45 kilometres (28 mi) at it easternmost point at Silvan, east of the Melbourne city centre. The park was proclaimed on 13 December 1987, amalgamating the Ferntree Gully National Park, Sherbrooke Forest and Doongalla Estate. In 1997 the Olinda State Forest, Mt. Evelyn and Montrose Reserve were formally added to the national park.', 1, 1, 1, NULL),
(148, 'WetnWild Sydney', 'themepark', 'Sydney', 'Australia', 25, 'WetnWild Sydney is a water park in Prospect, New South Wales, Australia, that opened on 12 December 2013. The park was announced on 11 September 2010 and is the third WetnWild water park operated by Village Roadshow Theme Parks, after locations on the Gold Coast and Las Vegas.', 1, 1, 1, NULL),
(149, 'Luna Park', 'themepark', 'Sydney', 'Australia', 22.5, 'Luna Park Sydney (originally Luna Park Milsons Point, also known as Sydneys Luna Park) is an amusement park located in Sydney, New South Wales, Australia. Luna Park is located at Milsons Point, on the northern shore of Sydney Harbour. Luna Park is one of two amusement parks in the world that are protected by government legislation; several of the buildings on the site are also listed on the Register of the National Estate and the NSW State Heritage Register. The park has been utilised as a filming location for several movies and television shows.', 1, 1, 1, NULL),
(150, 'St Kilda Beach', 'beach', 'Melbourne', 'Australia', 6, 'St Kilda Beach is a beach located in St Kilda, Port Phillip, Victoria, Australia, 6 kilometres (3.7 mi) south from the Melbourne city centre. It is Melbournes most famous beach. The beach is a sandy beach about 700 metres (2,300 ft) long between St Kilda Marina and St Kilda Harbour along Jacka Boulavard and St Kilda Esplanade. It is located at the north-east corner of Port Phillip and is protected from ocean swell, though still affected by strong westerly winds. With Port Phillip Bay being open to the sea, St Kilda Beach is subject to regular tides.', 1, 1, 0, NULL),
(151, 'Elwood Beach', 'beach', 'Melbourne', 'Australia', 5.05, 'Elwood Beach is a popular bayside beach destination during summer, where the beaches are used recreationally for windsurfing, cycling, cricket and walking.', 1, 1, 0, NULL),
(152, 'Bondi Beach', 'beach', 'Sydney', 'Australia', 8.05, 'Bondi Beach is a popular beach and the name of the surrounding suburb in Sydney, New South Wales, Australia. Bondi Beach is located 7 km (4 mi) east of the Sydney central business district, in the local government area of Waverley Council, in the Eastern Suburbs. Bondi, North Bondi and Bondi Junction are neighbouring suburbs. Bondi Beach is one of the most visited tourist sites in Australia.', 1, 1, 0, NULL),
(153, 'Coogee Beach', 'beach', 'Sydney', 'Australia', 9.5, 'Coogee is a beachside suburb of local government area City of Randwick 8 kilometres south-east of the Sydney central business district, in the state of New South Wales, Australia. It is also a part of the Eastern Suburbs region. The Tasman Sea and Coogee Bay along with Coogee Beach lie towards the eastern side of the suburb. The beach is popular among families and famous for its safe swimming conditions. The boundaries of Coogee are formed mainly by Clovelly Road, Carrington Road and Rainbow Street, with arbitrary lines drawn to join these thoroughfares to the coast in the north-east and south-east corners.', 1, 1, 0, NULL),
(154, 'Brisbane City Hall', 'landmark', 'Brisbane', 'Australia', 45, 'Brisbane City Hall, in Brisbane, Queensland, Australia, is the seat of the Brisbane City Council. It is located adjacent to King George Square, where the rectangular City Hall has its main entrance. The City Hall also has frontages and entrances in both Ann Street and Adelaide Street. The building is considered one of Brisbanes finest and is registered on the Register of the National Estate since 1978. The building has been used for royal receptions, pageants, orchestral concerts, civic greetings, flower shows, school graduations and political meetings. In 2009, it was discovered that the building suffered from severe structural problems. After a three-year restoration, the building was re-opened on 6 April 2013.', 1, 1, 0, NULL),
(155, 'St Helena Island National Park', 'nature', 'Brisbane', 'Australia', 60, 'St Helena Island is a heritage-listed island in Queensland, Australia, 21 kilometres (13 mi) east of Brisbane and 4 kilometres (2.5 mi) east of the mouth of the Brisbane River in Moreton Bay. Originally used as a prison, it is now a national park. Local Australian Aborigines called the island Noogoon but it was renamed St Helena after an aboriginal named Napoleon was exiled there in 1826. The island is visible from the mainland, particularly the suburbs of Wynnum, Manly and Lota. It has its own permanent water supply, a spring in the centre of the island. Many migratory birds use the island as a watering hole; it forms part of the Moreton Bay and Pumicestone Passage Important Bird Area, so identified by BirdLife International because it supports large numbers of migratory waders, or shorebirds.', 1, 1, 0, NULL),
(156, 'Sir Thomas Brisbane Planetarium', 'scientific', 'Brisbane', 'Australia', 0, 'The Sir Thomas Brisbane Planetarium is located on the grounds of the Brisbane Botanic Gardens in the suburb of Toowong, Brisbane, Queensland, Australia. The Planetarium was officially opened on 24 May 1978. The Planetarium is named after Sir Thomas Brisbane, governor of the colony of New South Wales (1821 - 1825) and well known Scottish astronomer who established the first significant observatory at Parramatta, Australia, in 1822 for mapping the southern skies. The Planetarium is located about 5 kilometres (3.1 mi) from the Central Business District, and is administered by the Brisbane City Council.', 1, 1, 0, NULL),
(157, 'Melbourne Cricket Ground', 'entertainment', 'Melbourne', 'Australia', 36.9, 'The Melbourne Cricket Ground (MCG), also known simply as The G, is an Australian sports stadium located in Yarra Park, Melbourne, Victoria, and is home to the Melbourne Cricket Club. It is the 10th-largest stadium in the world, the largest in Australia, the largest in the Southern Hemisphere, the largest cricket ground by capacity, and has the tallest light towers of any sporting venue. The MCG is within walking distance of the city centre and is served by the Richmond railway station, Richmond, and the Jolimont railway station, East Melbourne. It is part of the Melbourne Sports and Entertainment Precinct.', 1, 1, 0, NULL),
(158, 'Puffing Billy Railway', 'industrial', 'Melbourne', 'Australia', 35.55, 'The Puffing Billy Railway is a 2 ft 6 in (762 mm) narrow gauge heritage railway in the Dandenong Ranges near Melbourne, Australia. The primary starting point, operations and administration centre, main refreshment room (also selling souvenirs) and ticket purchasing are located at Belgrave station. Journeys may also be commenced at out-stations of which some have limited facilities for the purchase of tickets, refreshments and souvenirs. Tickets usually may also be purchased from the conductor aboard the train.', 1, 1, 0, NULL),
(159, 'St Pauls Cathedral', 'landmark', 'Melbourne', 'Australia', 0, 'St Pauls Cathedral is an Anglican cathedral in Melbourne, Victoria, Australia. It is the cathedral church of the Diocese of Melbourne and the seat of the Archbishop of Melbourne who is also the metropolitical archbishop of the Province of Victoria and, since 28 June 2014, the present seat of the Primate of Australia. The cathedral was built in stages and is one of the City of Melbournes major landmarks.', 1, 1, 0, NULL),
(160, 'Hyde Park', 'entertainment', 'Sydney', 'Australia', 0, 'Hyde Park, the oldest public parkland in Australia, is a 16.2-hectare (40-acre) park in the central business district of Sydney, New South Wales. Hyde Park is on the eastern side of the Sydney city centre. It is the southernmost of a chain of parkland that extends north to the shore of Sydney Harbour via The Domain and Sydneys Royal Botanic Gardens. Hyde Park is approximately rectangular in shape, being squared at the southern end and rounded at the northern end. It is bordered on the west by Elizabeth Street, on the east by College Street, on the north by St. James Road and Prince Albert Road and on the south by Liverpool Street.', 1, 1, 1, NULL),
(161, 'Chinese Garden of Friendship', 'nature', 'Sydney', 'Australia', 0, 'The Chinese Garden of Friendship is a Chinese garden in Chinatown, Sydney, Australia. Modeled on the typical private gardens of the Ming Dynasty, the garden offers an insight into Chinese heritage and culture. The Chinese Garden of Friendship was designed by Sydneys Chinese sister city, Guangzhou in China. Chinatown, Sydney complements the areas already rich Chinese heritage and culture. The gardens were officially opened in 1988 as part of Sydneys bicentennial celebrations and they were named the Garden of Friendship symbolizing the bond established between China and Australia.', 1, 1, 0, NULL),
(162, 'Queen Victoria Building', 'industrial', 'Sydney', 'Australia', 0, 'The Queen Victoria Building (or QVB), is a late nineteenth-century building designed by the architect George McRae in the central business district of Sydney, Australia. The Romanesque Revival building was constructed between 1893 and 1898 and is 30 metres (98 ft) wide by 190 metres (620 ft) long. The building fills a city block bounded by George, Market, York and Druitt Streets. Designed as a marketplace, it was used for a variety of other purposes, underwent remodelling and suffered decay until its restoration and return to its original use in the late twentieth century.', 1, 1, 0, NULL),
(163, 'Trung House 4', 'HISTORICAL', 'Anguilla', 'Anguilla', 322.3, 'this is my house', 0, 0, 0, NULL),
(164, 'Trung House 5', 'HISTORICAL', 'Ho Chi Minh', 'Vietnam', 322.33, 'this is my house', 0, 0, 0, NULL),
(165, 'Eiffel Tower', 'landmark', 'Paris', 'France', 19, 'The Eiffel Tower is a wrought iron lattice \ntower on the Champ de Mars inParis, France. It is named after the engineer Gustave Eiffel, whose company \ndesigned and built the tower. Constructed from 188789 as the entrance to the 1889 World\'s Fair, it was \ninitially criticized by some of France\'s leading artists and intellectuals for its design, but it has \nbecome a global cultural icon of France and one of the most recognisable structures in the world. The \nEiffel Tower is the most-visited paid monument in the world; 6.91 million people ascended it in 2015.', 1, 0, 0, NULL),
(166, 'Notre Dame de Paris', 'landmark', 'Paris', 'France', 0, 'Notre-Dame de Paris; meaning \"Our \nlady of Paris\"; also known as Notre-Dame Cathedral or simply Notre-Dame, is a medieval Catholic \ncathedral on the le de la Cit in the fourth arrondissement of Paris, France. The cathedral is widely \nconsidered to be one of the finest examples of French Gothic architecture, and is among the largest and \nmost well-known church buildings in the world. The naturalism of its sculptures and stained glass are in \ncontrast with earlier Romanesque architecture.', 1, 1, 1, NULL),
(167, 'The Louvre', 'landmark', 'Paris', 'France', 17, 'The Louvre or the Louvre Museum is the \nworld\'s largest museum and a historic monument in Paris, France. A central landmark of the city, it is \nlocated on the Right Bank of the Seine in the city\'s 1st arrondissement (district or ward). Nearly \n35,000 objects from prehistory to the 21st century are exhibited over an area of 72,735 square metres \n(782,910 square feet). The Louvre is the world\'s second most visited museum after the Palace Museum in \nChina, receiving more than 9.26 million visitors in 2014.', 1, 1, 1, NULL),
(168, 'Sacr-Cur', 'landmark', 'Paris', 'France', 0, 'The Basilica of the Sacred Heart of Paris, \ncommonly known as Sacr-Cur Basilica and often simply Sacr-Cur, is a Roman Catholic church and minor \nbasilica, dedicated to the Sacred Heart of Jesus, in Paris, France. A popular landmark, the basilica is \nlocated at the summit of the butte Montmartre, the highest point in the city. Sacr-Cur is a double \nmonument, political and cultural, both a national penance for the defeat of France in the 1871 Franco-\nPrussian War and the socialist Paris Commune of 1871 crowning its most rebellious neighborhood, and an \nembodiment of conservative moral order, publicly dedicated to the Sacred Heart of Jesus, which was an \nincreasingly popular vision of a loving and sympathetic Christ.', 1, 1, 1, NULL),
(169, 'Champ de Mars', 'landmark', 'Paris', 'France', 0, 'The Champ de Mars is a large public \ngreenspace in Paris, France, located in the seventh arrondissement, between the Eiffel Tower to the \nnorthwest and the cole Militaire to the southeast. The park is named after the Campus Martius (\"Mars \nField\") in Rome, a tribute to the Latin name of the Roman God of war. The name also alludes to the fact \nthat the lawns here were formerly used as drilling and marching grounds by the French military.', 1, 1, 1, NULL),
(170, 'Arc de Triomphe', 'historical', 'Paris', 'France', 13, 'The Arc de Triomphe de l\'toile is \none of the most famous monuments in Paris, standing at the western end of the Champs-lyses at the \ncenter of Place Charles de Gaulle, formerly named Place de l\'toile  the toile or \"star\" of the \njuncture formed by its twelve radiating avenues.\n\nThe Arc de Triomphe should not be confused with a smaller arch, the Arc de Triomphe du Carrousel, which \nstands west of the Louvre. The Arc de Triomphe honours those who fought and died for France in the \nFrench Revolutionary and the Napoleonic Wars, with the names of all French victories and generals \ninscribed on its inner and outer surfaces. Beneath its vault lies the Tomb of the Unknown Soldier from \nWorld War I.', 1, 1, 1, NULL),
(171, 'Place de la Bastille', 'historical', 'Paris', 'France', 0, 'The Place de la Bastille is a \nsquare in Paris where the Bastille prison stood until the \"Storming of the Bastille\" and its subsequent \nphysical destruction between 14 July 1789 and 14 July 1790 during the French Revolution. No vestige of \nthe prison remains.\n\nThe square straddles 3 arrondissements of Paris, namely the 4th, 11th and 12th. The square and its \nsurrounding areas are normally called simply Bastille.\nJuly Column\n\nThe July Column (Colonne de Juillet) which commemorates the events of the July Revolution (1830) stands \nat the center of the square. Other notable features include the Bastille Opera, the Bastille subway \nstation and a section of the Canal Saint Martin. Prior to 1984, the former Bastille railway station \nstood where the opera house now stands.\n\nAs a consequence of its historical significance, the square is often the site or point of departure of \npolitical demonstrations, including the massive anti-CPE demonstration of 28 March 2006.', 1, 1, 1, NULL),
(172, 'Conciergerie', 'historical', 'Paris', 'France', 11.5, 'The Conciergerie is a building in \nParis, France, located on the west of the le de la Cit (literally \"Island of the City\"), formerly a \nprison but presently used mostly for law courts. It was part of the former royal palace, the Palais de \nla Cit, which consisted of the Conciergerie, Palais de Justice and the Sainte-Chapelle. Hundreds of \nprisoners during the French Revolution were taken from the Conciergerie to be executed by guillotine at \na number of locations around Paris.', 1, 1, 0, NULL),
(173, 'Catacombs of Paris', 'historical', 'Paris', 'France', 12, 'The Catacombs of Paris are \nunderground ossuaries in Paris, France, which hold the remains of more than six million people in a \nsmall part of the ancient Mines of Paris tunnel network. Located south of the former city gate \"Barrire \ndEnfer\" (Gate of Hell) beneath Rue de la Tombe-Issoire, the ossuary was founded when city officials had \ntwo simultaneous problems: a series of cave-ins beginning 1774, and overflowing cemeteries, particularly \nSaint Innocents. Nightly processions of bones from 1786 to 1788 transferred remains from cemeteries to \nthe reinforced tunnels, and more remains were added during later years. The underground cemetery became \na tourist attraction on a small scale from the early 19th century, and has been open to the public on a \nregular basis since 1874 with surface access from a building at Place Denfert-Rochereau in the extreme \nsouthern part of the city of Paris.\n\nThe Catacombs are among the 14 City of Paris Museums managed by Paris Muses since January 1, 2013. The \ncatacombs are known formally as l\'Ossuaire Municipal or Catacombes officiels and have been called \"The \nWorld\'s Largest Grave\" due the number of remains buried. Although the ossuary comprises only a small \nsection of the underground \"carrires de Paris\" (\"quarries of Paris\"), Parisians presently often refer \nto the entire tunnel network as \"the catacombs\".', 1, 1, 1, NULL),
(174, 'Arnes de Lutce', 'historical', 'Paris', 'France', 0, 'The Arnes de Lutce are among the \nmost important remains from the Gallo-Roman era in Paris (known in antiquity as Lutetia, or Lutce in \nFrench), together with the Thermes de Cluny. Lying in what is now the Quartier Latin, this amphitheater \ncould once seat 15,000 people, and was used to present gladiatorial combats.', 1, 1, 0, NULL),
(175, 'Muse d\'Orsay', 'artistic', 'Paris', 'France', 14, 'The Muse d\'Orsay is a museum in \nParis, France, on the left bank of the Seine. It is housed in the former Gare d\'Orsay, a Beaux-Arts \nrailway station built between 1898 and 1900. The museum holds mainly French art dating from 1848 to \n1914, including paintings, sculptures, furniture, and photography. It houses the largest collection of \nimpressionist and post-Impressionist masterpieces in the world, by painters including Monet, Manet, \nDegas, Renoir, Czanne, Seurat, Sisley, Gauguin, and Van Gogh. Many of these works were held at the \nGalerie nationale du Jeu de Paume prior to the museum\'s opening in 1986. It is one of the largest art \nmuseums in Europe.', 1, 1, 0, NULL),
(176, 'Muse de Cluny - Le monde mdival', 'artistic', 'Paris', 'France', 11, 'The Muse national \ndu Moyen ge, formerly Muse de Cluny, officially known as the Muse national du Moyen ge  Thermes et \nhtel de Cluny (\"National Museum of the Middle Ages  Cluny thermal baths and mansion\"), is a museum in \nParis, France. It is located in the 5th arrondissement at 6 Place Paul-Painlev, south of the Boulevard \nSaint-Germain, between the Boulevard Saint-Michel and the Rue Saint-Jacques. Among the principal \nholdings of the museum are the six The Lady and the Unicorn (La Dame  la licorne) tapestries.', 1, 1, 0, NULL),
(177, 'Sainte-Chapelle', 'artistic', 'Paris', 'France', 12, 'The Sainte-Chapelle is a royal chapel \nin the Gothic style, within the medieval Palais de la Cit, the residence of the Kings of France until \nthe 14th century, on the le de la Cit in the heart of Paris, France.\n\nBegun some time after 1238 and consecrated on 26 April 1248, the Sainte-Chapelle is considered among the \nhighest achievements of the Rayonnant period of Gothic architecture. It was commissioned by King Louis \nIX of France to house his collection of Passion relics, including Christ\'s Crown of Thornsone of the \nmost important relics in medieval Christendom.', 1, 1, 0, NULL);
INSERT INTO `Locations` (`LocationID`, `NameLocation`, `TypeLocation`, `City`, `Country`, `Price`, `Description`, `Morning`, `Afternoon`, `Evening`, `LocationImage`) VALUES
(178, 'Muse de l\'Orangerie', 'artistic', 'Paris', 'France', 11, 'The Muse de l\'Orangerie is an \nart gallery of impressionist and post-impressionist paintings located in the west corner of the \nTuileries Gardens next to the Place de la Concorde in Paris. Though most famous for being the permanent \nhome for eight Water Lilies murals by Claude Monet, the museum also contains works by Paul Czanne, \nHenri Matisse, Amedeo Modigliani, Pablo Picasso, Pierre-Auguste Renoir, Henri Rousseau, Alfred Sisley, \nChaim Soutine, and Maurice Utrillo, among others', 1, 1, 0, NULL),
(179, 'Pont Alexandre III', 'artistic', 'Paris', 'France', 0, 'Inaugurated on the occasion of the \n1900 Universal Exhibition and classed as a historic monument, the Pont Alexandre III is one of the most \nemblematic bridges in Paris because of its architecture and location. At its four extremities are huge \n17 metre-high pylons crowned with gilt bronze sculptures of winged horses representing the illustrious \nArts, Sciences, Commerce and Industry. Pont Alexandre III connects the Invalides on the Left Bank to the \nGrand Palais and Petit Palais on the Right Bank. From the bridge you can enjoy a sweeping view of these \nbuildings as well as the Eiffel Tower and over the Seine, which makes it a popular place for a stroll at \nany time of day or night.', 1, 1, 1, NULL),
(180, 'Montmartre', 'cultural', 'Paris', 'France', 0, 'Montmartre is a large hill in Paris\'s 18th \narrondissement. It is 130 metres (430 feet) high and gives its name to the surrounding district, part of \nthe Right Bank in the northern section of the city. The historic district established by the City of \nParis in 1995 is bordered by rue Caulaincourt and rue Custine on the north; rue de Clignancourt on the \neast; boulevard de Clichy and boulevard de Rochechouart to the south containing sixty hectares. \nMontmartre is primarily known for the white-domed Basilica of the Sacr-Cur on its summit and as a \nnightclub district. The other, older, church on the hill is Saint Pierre de Montmartre, which claims to \nbe the location at which the Jesuit order of priests was founded.', 1, 1, 1, NULL),
(181, 'Jardin du Luxembourg', 'cultural', 'Paris', 'France', 0, 'The Jardin du Luxembourg, or the \nLuxembourg Garden, located in the 6th arrondissement of Paris, was created beginning in 1612 by Marie \nde\' Medici, the widow of King Henry IV of France, for a new residence she constructed, the Luxembourg \nPalace. The garden today is owned by the French Senate, which meets in the Palace. It covers 23 hectares \nand is known for its lawns, tree-lined promenades, flowerbeds, the model sailboats on its circular \nbasin, and for the picturesque Medici Fountain, built in 1620.', 1, 1, 0, NULL),
(182, 'Tuileries Garden', 'cultural', 'Paris', 'France', 0, 'The Tuileries Garden is a public \ngarden located between the Louvre Museum and the Place de la Concorde in the 1st arrondissement of \nParis. Created by Catherine de Medici as the garden of the Tuileries Palace in 1564, it was eventually \nopened to the public in 1667, and became a public park after the French Revolution. In the 19th and 20th \ncentury, it was the place where Parisians celebrated, met, promenaded, and relaxed.', 1, 1, 1, NULL),
(183, 'Avenue des Champs-lyses', 'cultural', 'Paris', 'France', 0, 'The Avenue des Champs-\nlyses is an avenue in the 8th arrondissement of Paris, 1.9 kilometres (1.2 mi) long and 70 metres (230 \nft) wide, running between the Place de la Concorde and the Place Charles de Gaulle, where the Arc de \nTriomphe is located. It is known for its theatres, cafs and luxury shops, for the annual Bastille Day \nmilitary parade, and as the finish of the Tour de France cycle race. The name is French for the Elysian \nFields, the paradise for dead heroes in Greek mythology. The French proudly call their world-famous \nboulevard \"la plus belle avenue du monde\" (\"the world\'s most beautiful avenue\".', 1, 1, 1, NULL),
(184, 'Parc de la Villette', 'cultural', 'Paris', 'France', 0, 'The Parc de la Villette is the \nthird-largest park in Paris, 55.5 hectares in area, located at the northeastern edge of the city in the \n19th arrondissement. The park houses one of the largest concentration of cultural venues in Paris, \nincluding the Cit des Sciences et de l\'Industrie (City of Science and Industry, Europe\'s largest \nscience museum), three major concert venues, and the prestigious Conservatoire de Paris.', 1, 1, 1, NULL),
(185, 'Cit des Sciences et de l\'Industrie', 'scientific', 'Paris', 'France', 14, 'The Cit des \nSciences et de l\'Industrie is the biggest science museum in Europe. Located in Parc de la Villette in \nParis, France, it is one of the three dozen Cultural Centers of Science, Technology and Industry \n(CCSTI), promoting science and science culture.\n\nThe Cit is classified as a public establishment of an industrial and commercial character, an \nestablishment specialising in the fostering of scientific and technical culture. Created on the \ninitiative of President Giscard d\'Estaing, the goal of the Cit is to spread scientific and technical \nknowledge among the public, particularly for youth, and to promote public interest in science, research \nand industry.\n\nThe most notable features of the \"bioclimatic facade\" facing the park are Les Serres  three greenhouse \nspaces each 32 metres high, 32 metres wide and 8 metres deep. The facades of Les Serres were the first \nstructural glass walls to be constructed without framing or supporting fins.', 1, 1, 0, NULL),
(186, 'Palais de la Dcouverte', 'scientific', 'Paris', 'France', 13.5, 'The Palais de la \ndcouverte, part of Universcience, presents fundamental and contemporary science in a dynamic way in the \nform of interactive experiments explained by scientists.\nDiscover astronomy in the \'Planetarium\', biology, chemistry, maths, physics, earth sciences, the \n\'Salle d\'Electrostatique\' (Electrostatic Room), and a room devoted to the sun and planets.\nTwo new permanent spaces: the \'Salle Lumire\' (Light Room) where you can learn more about the \nchemistry, biology and physics behind this topic, and the \'Espace Hydrogne\' (Hydrogen Area) which is \ndevoted to the applications and issues with this form of energy!\nThe \'Salle d\'Acoustique\' (Acoustics Room) offers a series of experiments and demonstrations \ninvestigating the phenomenon of sound: the movement and speed of sound, the structure of simple and \ncomplex sounds (organ pipes), harmonic analysis and synthesis, interference and diffraction, the Doppler \neffect, beats and resonance.\nGene workshops: educational and cultural space devoted to genetics and DNA.', 1, 1, 0, NULL),
(187, 'Aquarium de Paris - Cinaqua', 'scientific', 'Paris', 'France', 22, 'In the Trocadero \ngardens, opposite the Eiffel Tower, take some time to escape and relax ...In an area of 3,500 m, \ndiscover 43 tanks, more than 10,000 fish and invertebrates, 32 sharks, a touch pool and plenty of fun \ninteractive activities. Even the restaurant has its own aquarium with 600,000 litres of water! On the \nfirst Saturday of every month, you can visit the aquarium at night and enjoy a glass of complimentary \nchampagne as you visit.', 1, 1, 0, NULL),
(188, 'Aquarium tropical de la Porte Dore', 'scientific', 'Paris', 'France', 10.5, 'Palais de la \nPorte Dore - Aquarium Tropical. Opened in 1931 for the Paris Colonial Exposition, the Aquarium Tropical \npresents some 5,000 animals and more than 300 species: primitive and electric fish, Asian waters, and \naquatic life from Africa and South America, and of course a show with the crocodile pit, sharks, and \npiranhas. A unique experience of aquatic biodiversity. A must-see with the family, set inside an \nexceptional art deco building in Paris.', 1, 1, 0, NULL),
(189, 'Aquarium Sea Life Paris - Val-d\'Europe', 'scientific', 'Paris', 'France', 19.5, 'SEA LIFE \nAquarium: More than 5,000 amazing sea animals to discover!\nThe Paris Val d\'Europe SEA LIFE Aquarium, located in the Val d\'Europe shopping centre 35 minutes from \nParis at Marne la Valle, near Disneyland, gives you the chance to go on a journey into a fascinating \nmarine world of 8 themed zones, while always aiming to raise awareness about the protection of marine \nspecies.\nKids and adults can see some 350 species in 50 tanks over the course of their visit, including 13 \nspecies of shark, turtles, seahorses, rays, piranhas, tropical fish and much more!\nDon\'t miss the regular activities and events, talks, feeding sessions, interactive rock pool and \nitinerary for children! There is also a playground for children at the end of their visit!', 1, 1, 0, NULL),
(190, 'Latin Quarter, Paris', 'industrial', 'Paris', 'France', 0, 'The Latin Quarter of Paris is \nan area in the 5th and the 6th arrondissements of Paris. It is situated on the left bank of the Seine, \naround the Sorbonne.\n\nKnown for its student life, lively atmosphere and bistros, the Latin Quarter is the home to a number of \nhigher education establishments besides the university itself, such as the cole Normale Suprieure, the \ncole des Mines de Paris, Panthon-Assas University, the Schola Cantorum, and the Jussieu university \ncampus. Other establishments such as the cole Polytechnique have relocated in recent times to more \nspacious settings.\n\nThe area gets its name from the Latin language, which was once widely spoken in and around the \nUniversity since Latin was the language of learning in the Middle Ages in Europe.', 1, 1, 1, NULL),
(191, 'Centre Georges Pompidou', 'industrial', 'Paris', 'France', 0, 'Centre Georges Pompidou is a \ncomplex building in the Beaubourg area of the 4th arrondissement of Paris, near Les Halles, rue \nMontorgueil and the Marais. It was designed in the style of high-tech architecture by the architectural \nteam of Richard Rogers and Renzo Piano, along with Gianfranco Franchini.\n\nIt houses the Bibliothque publique d\'information (Public Information Library), a vast public library, \nthe Muse National d\'Art Moderne, which is the largest museum for modern art in Europe, and IRCAM, a \ncentre for music and acoustic research. Because of its location, the Centre is known locally as \nBeaubourg. It is named after Georges Pompidou, the President of France from 1969 to 1974 who \ncommissioned the building, and was officially opened on 31 January 1977 by President Valry Giscard \nd\'Estaing. As of 2006, the Centre Pompidou has had over 180 million visitors since 1977 and more than \n5,209,678 visitors in 2013, including 3,746,899 for the museum.', 1, 1, 1, NULL),
(192, 'Le Marais', 'industrial', 'Paris', 'France', 0, 'Le Marais is a historic district in Paris, \nFrance. Long the aristocratic district of Paris, it hosts many outstanding buildings of historic and \narchitectural importance. It spreads across parts of the 3rd and 4th arrondissements in Paris (on the \nRive Droite, or Right Bank, of the Seine).', 1, 1, 1, NULL),
(193, 'Rue de Rivoli', 'industrial', 'Paris', 'France', 0, 'Rue de Rivoli is one of the most \nfamous streets of Paris, a commercial street whose shops include the most fashionable names in the \nworld. It bears the name of Napoleon\'s early victory against the Austrian army, at the battle of \nRivoli, fought January 14 and 15, 1797. The rue de Rivoli marked a transitional compromise between an \nurbanism of prestige monuments and aristocratic squares, and the forms of modern town planning by \nofficial regulation.', 1, 1, 1, NULL),
(194, 'Printemps Haussmann', 'industrial', 'Paris', 'France', 0, 'Printemps is a French department \nstore (French: grand magasin, literally \"big store\"). The Printemps stores focus on beauty, lifestyle, \nfashion, accessories, and men\'s wear.', 1, 1, 0, NULL),
(195, 'Pont des Arts', 'entertainment', 'Paris', 'France', 0, 'The Pont des Arts or Passerelle des \nArts is a pedestrian bridge in Paris which crosses the River Seine. It links the Institut de France and \nthe central square (cour carre) of the Palais du Louvre, (which had been termed the \"Palais des Arts\" \nunder the First French Empire).', 1, 1, 1, NULL),
(196, 'Place de la Concorde', 'entertainment', 'Paris', 'France', 0, 'The Place de la Concorde is \none of the major public squares in Paris, France. Measuring 8.64 hectares (21.3 acres) in area, it is \nthe largest square in the French capital. It is located in the city\'s eighth arrondissement, at the \neastern end of the Champs-lyses.', 1, 1, 1, NULL),
(197, 'Parc Zoologique de Paris', 'entertainment', 'Paris', 'France', 23.5, 'The Parc Zoologique de \nParis: an escape into nature\nThe Parc Zoologique is open to visitors year round, offering you a unique opportunity to relax right on \nParis doorstep as you explore over two miles of trails traversing five distinct biozones.\nOver 2000 animals are waiting just a stones throw from Porte Dore metro station, representing a sample \nof 125 different species of wild fauna. \nObserve rare and little known species: the mischievous bush dog, the adorable manatee, and the graceful \nEuropean otter are all perfectly at ease in their habitat.\nFor your comfort, visitor facilities include a picnic area, two restaurants, buggy hire, and a gift shop \nwhere you can treat yourself.\nThe Parc Zoologique de Paris: a new breed of zoo.', 1, 1, 0, NULL),
(198, 'Muse Grvin', 'entertainment', 'Paris', 'France', 26.5, 'A marble staircase leads you to the \nHall of Mirrors, a recreation of the one at the 1900 World Fair in Paris. Further on, more than 250 \ncelebrities await: film stars, sporting legends, historical figures. Sculpted, then moulded in wax and \nresin, made-up and dressed, each figure is more real than the original! Charlie Chaplin, Lady Gaga, \nBarack Obama, Zlatan Ibrahimovic  areready to pose for a photo with you!', 1, 1, 0, NULL),
(199, 'L\'le de Robinson', 'entertainment', 'Paris', 'France', 21, 'An indoor amusement park that \nis unique in Europe and is themed on Robinson Crusoe. Situated on the outskirts of Paris, at Montreuil, \n(Metro line 9: Croix de Chavaux), this park is ideal for families with children aged 4 to 12 years. A \nsecured space is offered for the younger children.\nAll the activities at the park can be completed as a family.\nBar, snack area, outdoor planting areas for bigger children and for adults.\nWe organize birthday parties for children all year round.', 1, 1, 0, NULL),
(200, 'Parc des Buttes Chaumont', 'nature', 'Paris', 'France', 0, 'The Buttes-Chaumont Park, in \nthe north-east of Paris, is one of the biggest and original green spaces in Paris, measuring 25 \nhectares. Its construction on quarries explains its impressive steepness and change in levels and \nheights. Visitors can appreciate stunning views of the city from this hilly setting, especially in the \nMontmartre district. The layout gives it a particular charm: caves and waterfalls, a suspended bridge, \nand a high viewpoint. It is brightened up with exotic, indigenous trees and numerous birds (seagulls, \nmoorhens, and mallard ducks) share the area and enjoy the artificial lake. Entertainment for children \nalso takes place in the park and there are break areas where you can get something to eat.', 1, 1, 0, NULL),
(201, 'le Saint-Louis', 'nature', 'Paris', 'France', 0, 'The le Saint-Louis is one of two \nnatural islands in the Seine river, in Paris, France (the other natural island is le de la Cit; the \nle aux Cygnes is artificial).\n\nThe le Saint-Louis is connected to the rest of Paris by four bridges to both banks of the river, and to \nthe le de la Cit by the Pont Saint-Louis. This island was formerly used for the grazing of market \ncattle and stocking wood.\n\nThe island is located within the 4th arrondissement of Paris and has a population of 4,453.', 1, 1, 1, NULL),
(202, 'Parc Monceau', 'nature', 'Paris', 'France', 0, 'The construction of Parc Monceau dates back \nto the 17th century, under the orders of the Duke of Chartres. Situated in the 8th arrondissement, today \nit is one of the most elegant gardens in Paris, and a reflection of the district. Visitors can enter \nthrough the great wrought iron gates embellished with gold. Walking around the park, youll find many \nbeautiful surprises: numerous statues, a Renaissance archway belonging to the former Paris City Hall, \nspectacular trees, a wide variety of birds and a large pond. Parc Monceau is surrounded by luxury \nbuildings and sumptuous mansions, including the Muse Cernuschi (Museum of Asian Arts). A peaceful and \npleasant park visited by Parisians and tourists. The park also features playgrounds for children.', 1, 1, 1, NULL),
(203, 'Canal Saint-Martin', 'nature', 'Paris', 'France', 0, 'The Canal Saint-Martin is a 4.5 km \nlong canal in Paris. It connects the Canal de l\'Ourcq to the river Seine and runs underground between \nBastille (Paris Mtro) and Rpublique (Paris Mtro). It is drained and cleaned every 10-15 years, \nuncovering tonnage of garbage and treasure alike.', 1, 1, 1, NULL),
(204, 'Bois de Vincennes', 'nature', 'Paris', 'France', 0, 'The Bois de Vincennes is the \ncapital\'s second largest \'green lung\', after the Bois de Boulogne. It is located in the east of \nParis, on the edge of the 12th arrondissement. Many organizations based in the Bois de Vincennes enable \nvisitors to find out more about the wood and get a closer look at its wildlife; the cole du Breuil and \nits arboretum, the Jardin d\'agronomie tropicale, the Ferme de Paris, the Maison Paris Nature, \nornithological reserves, etc. The Chateau de Vincennes, a magnificent example of medieval architecture, \nremains the wood\'s most notable monument, open every day. There are plenty of chances to relax, have \nfun or play sport. The Parc Floral is a family paradise with its play areas, including 18-hole mini \ngolf, slides and ping-pong tables. The Parc Floral also offers many free events, especially in the \nsummer; Paris Jazz Festival, the \'Pestacles\' festival, Festival Classique au Vert ... On one of the \nlakes, visitors can go for a boat ride, and fans of horse racing can bet at the racecourse. The Bois de \nVincennes is an unmissable place to explore on foot, by bike, alone, as a couple, with friends or as a \nfamily!', 1, 1, 1, NULL),
(205, 'Disneyland Paris', 'themepark', 'Paris', 'France', 80, 'Too old? Are you sure?\nEven big kids can have great fun and thrills in a day at Disneyland.\nWith 2 Disney parks, more than 50 attractions, shows and parades, Disneyland Paris promises a unique \nday with friends or family.\nWith 5 themed worlds, the Parc Disneyland is a dream place for big kids on the lookout for magic and \nlots of fun! Feel the adrenaline exploring the far reaches of space or the remains of an abandoned \ntemple.\nNext door, the Walt Disney Studios Park offers many adventures and thrills: defy gravity in a \nplummeting elevator, live a 100% Rock \'n\' Roll adventure with bends and looping or enjoy Remy\'s mad \nadventure! But save some energy to enjoy the fantastic shows and parades late into the night.\nJust a day at Disneyland Paris for a lifetime of memories is a lot closer than you ever thought \npossible.', 1, 1, 1, NULL),
(206, 'Parc Astrix', 'themepark', 'Paris', 'France', 49, 'Welcome to the craziest of theme parks!\n\nEmbark on an adventure to the heart of the famous Village and get a taste of what it\'s like to live the \nlife of a Gaul; enter the Roman Empire and enlist yourself in the army or come and watch our proud \nlegionnaires perform in the Arena; plunge into Ancient Greek mythology; put your courage to the test and \nbrave the Vikings and travel through time and walk through the streets of Paris from the Middle Ages to \nthe 19th century.\n\nNumerous challenges for children and adults to take on in the hope of becoming truly invincible!', 1, 1, 1, NULL),
(207, 'Notre-Dame de la Garde', 'landmark', 'Marseille', 'France', 32, 'Notre-Dame de la Garde \n(literally Our Lady of the Guard) is a Catholic basilica in Marseille, France. This Neo-Byzantine church \nwas built by the architect Henri-Jacques Esprandieu on the foundations of an ancient fort. The fort was \nlocated at the highest natural elevation in Marseille, a 149 m (489 ft) limestone outcropping on the \nsouth side of the Old Port of Marseille. It is an important local landmark and the site of a popular \nannual pilgrimage every year on Assumption Day, 15 August.', 1, 1, 0, NULL),
(208, 'glise Saint-Ferrol les Augustins', 'landmark', 'Marseille', 'France', 0, 'The glise \nSaint-Ferrol les Augustins is a Roman Catholic church in Marseille.', 1, 1, 0, NULL),
(209, 'Old Port of Marseille', 'landmark', 'Marseille', 'France', 0, 'The Old Port of Marseille is \nlocated at the end of the Canebire. It has been the natural harbour of Marseille since antiquity and is \nnow the main popular place in Marseille, mainly pedestrian since 2013.', 1, 1, 1, NULL),
(210, 'Chteau d\'If', 'landmark', 'Marseille', 'France', 7, 'Made famous by Alexandre Dumas\' \nclassic 1840s\' novel Le Comte de Monte Cristo (The Count of Monte Cristo), the 16th-century fortress-\nturned-prison Chteau d\'If sits on a 12 sq mile (30 sq km) island, 2 miles (3.5km) west of the Vieux \nPort. Political prisoners were incarcerated here, along with hundreds of Protestants (many of whom \nperished in the dungeons), the Revolutionary hero Mirabeau, and the Communards of 1871. In 1890 the \nprison was closed and the island opened to the public.', 1, 1, 0, NULL),
(211, 'glise Saint-Vincent de Paul', 'landmark', 'Marseille', 'France', 0, 'This 1886 neo gothic \nchurch was inspired by the designs of the Reims Cathedral and the Amiens Cathedral. It is a striking \nfeature of Marseilles sky, soaring high as if it were about rise off the ground. It was built on the \nsite of an old convent and chapel of Reformed Augustinians. Highlights are:\nA statue of Joan of Arc in the front\nBronze panels on the doors\nStained glass rose window, and all the incredible stained glass\nThe church spires rising 70 metres\nThe regal pipe organs\n', 1, 1, 1, NULL),
(212, 'Fort Saint-Jean', 'historical', 'Marseille', 'France', 0, 'Fort Saint-Jean is a \nfortification in Marseille, built in 1660 by Louis XIV at the entrance to the Old Port. Since 2013 it is \nlinked by two thin bridges to the historical district Le Panier, and to the Museum of European and \nMediterranean Civilisations, the first French national museum to be located outside Paris.', 1, 1, 0, NULL),
(213, 'Abbey of St. Victor, Marseille', 'historical', 'Marseille', 'France', 4, 'The Abbey of \nSaint Victor is a late Roman former monastic foundation in Marseille in the south of France, named after \nthe local soldier saint and martyr, Victor of Marseilles. Its history dates back to the fifth century, \nwas in ruins by the ninth century and by the 13th century, when other world-famous churches were first \nbeing built, Abbaye Saint Victor was being renovated. Martyrs died here, the library was dismantled \nsimply to please a de Medici family member, and in the late 18th century, the site was stripped of all \nof its finery.', 0, 1, 0, NULL),
(214, 'Musum d\'histoire naturelle de Marseille', 'historical', 'Marseille', 'France', 10, 'The \nMusum dhistoire naturel de Marseille or Natural History Museum of Marseille was founded in 1819 by \nJean-Baptiste, marquis de Montgrand. It is located in the Palais Longchamp.\nThe museum houses 83,000 zoological specimens, 200, 000 botanical specimens, 81,000 fossils, and 8,000 \nmineral specimens.\nThe four exhibitions areas are\nla salle Safari -World Fauna- section concentrating on accidental imports through the port.\nla salle de Provence-Regional Fauna and Flora\nla salle d\'ostologie- Comparative Anatomy\nla salle de prhistoire, sur l\'volution- Prehistory and Evolution.\nThe museum organises conferences and temporary exhibitions.\nHistory-One of the museums directors was Antoine Fortun Marion(18461900).', 1, 1, 0, NULL),
(215, 'Museum of European and Mediterranean Civilisations', 'historical', 'Marseille', 'France', 11.5, 'The Museum of European and Mediterranean Civilisations (MuCEM) (French: Muse des Civilisations \nde l\'Europe et de la Mditerrane) is a national museum located in Marseille, France. It was \ninaugurated on 7 June 2013 as part of Marseille-Provence 2013, a year when Marseille was designated as \nthe European Capital of Culture. Located at the entrance to the Vieux Port, the MuCEM features a \ncontemporary building designed by Rudy Riciotti (a dark cube overlaid with concrete lacework built on \nthe former \"J4\" pier) and the historic Fort St Jean (restored ramparts and walkways, towers, inner \npassages and vaulted rooms), whose ochre outline bears witness to the city\'s long history. An \nimpressive footbridge connects the two buildings. The collections inside are an ode to the \nMediterranean, its history, art of living and heritage, but also its present. Don\'t miss the Galerie de \nla Mditerrane on the ground-floor of J4.', 1, 1, 0, NULL),
(216, 'French Foreign Legion Museum', 'historical', 'Marseille', 'France', 8.5, 'The French Foreign \nLegion Museum (Muse de la Lgion trangre) is a military museum in the headquarters of the French \nForeign Legion at Aubagne. The museum houses a collection of the Legion\'s history from its creation to \nthe present day.', 1, 1, 0, NULL),
(217, 'Muse Cantini', 'artistic', 'Marseille', 'France', 7, 'The Muse Cantini is a museum in \nMarseilles that has been open to the public since 1936. The museum specializes in modern art, especially \npaintings from the first half of the twentieth century. Though its often overshadowed by Marseilles \nmultimillion euro flagship museums, this excellent art museum conceals some surprising  and impressive \n finds behind its wrought-iron gates. The core collection contains some fantastic examples of 17th- and \n18th-century Provenal art, including Andr Derains Pinde, Cassis (1907) and Raoul Dufys Paysage de \nlEstaque (1908). A second section is dedicated to depictions of Marseille, with works by Max Ernst, \nJoan Mir, Andr Masson and others.', 1, 1, 0, NULL),
(218, 'Muse des Beaux-Arts, Marseille', 'artistic', 'Marseille', 'France', 47, 'The Muse des \nbeaux-arts de Marseille is one of the main museums in the city of Marseille, in the Provence-Alpes-Cte \nd\'Azur region. It occupies a wing of the Palais Longchamp, and displays a collection of paintings, \nsculptures and drawings from the 16th to 19th centuries.', 1, 1, 0, NULL),
(219, 'Chteau Borly', 'artistic', 'Marseille', 'France', 47, 'The Chteau Borly is a chateau in \nthe southern part of Marseille, France. Stately 18th-century country home, now a museum of decorative \narts & fashion of the period.', 1, 1, 0, NULL),
(220, 'Muse d\'Art Contemporain', 'artistic', 'Marseille', 'France', 47, 'Museum & library of art \npublications, showcasing French & international art from the 1960s onwards.', 1, 1, 0, NULL),
(221, 'Santons Marcel Carbonel ', 'artistic', 'Marseille', 'France', 8.5, 'Museum, by a workshop, \nwith over 2000 handmade, hand-painted crib figures from around the world.', 1, 1, 0, NULL),
(222, 'La Vieille Charit', 'cultural', 'Marseille', 'France', 5.5, 'Designed by Marseillais \narchitect Pierre Puget and constructed between 1671 and 1749, the 3-storey, arcaded courtyard of the \nCentre de la Vieille Charit wraps around Provence\'s most imposing Baroque church. Initially built as a \ncharity shelter for the town\'s poor but it was more like a prison: 17th century France was tough. \nChasse-gueux (beggar-hunters) were paid to round up the poor and put them into almshouses which were \neffectively workhouses. In 1736, the Centre housed 850, by 1760 it was 1059 but by 1781 it was less \nacceptable to imprison people just for being poor and the number dropped to 250.\n\nSpared during the French Revolution and used as an asylum, the Centre then became a barracks, a \nsoldiers\' rest home and, later, low-cost housing for people who lost their homes during WWII, the \nstunning arched pink-stone courtyard of the Centre de la Vieille Charite now houses Marseille\'s \nbeautiful Musee d\'Archeologie Mediterraneenne and Musee d\'Arts Africains, Oceaniens & Amerindiens. The \nlatter houses a diverse and often striking collection, including masks from the Americas, Africa and the \nPacific.', 1, 1, 0, NULL),
(223, 'Unit d\'habitation', 'cultural', 'Marseille', 'France', 12, 'The Unit d\'habitation is \nthe name of a modernist residential housing design principle developed by Le Corbusier, with the \ncollaboration of painter-architect Nadir Afonso. The concept formed the basis of several housing \ndevelopments designed by him throughout Europe with this name. The most famous of these developments is \nlocated in south Marseille.', 1, 1, 0, NULL),
(224, 'Mmorial de la Marseillaise', 'cultural', 'Marseille', 'France', 14.5, 'Inaugurated in March \n2011, in Marseille, the memorial of La Marseillaise traces, in a unique setting, the history of one of \nthe strongest symbols of the Republic of France: La Marseillaise national anthem.', 1, 1, 0, NULL),
(225, 'The Palais des Arts', 'cultural', 'Marseille', 'France', 10, 'The Palace of Arts, or \nPalazzo Carli, is one of the major places of the Phocaean city. It is located in the heart of downtown, \nnear the Old Port. \nBuilt at the end of the 19th century by the Marseilles architect Henri Esprandieu, this building was \nbuilt to accommodate the municipal library and the school of fine arts. Located on Place Auguste and \nFranois Carli, in the 1st arrondissement, it was quickly named the Palais Carli.', 1, 1, 0, NULL),
(226, 'Opra de Marseille', 'cultural', 'Marseille', 'France', 50, 'LOpra de Marseille, known \ntoday as the Opra Municipal, is an opera company located in Marseille, France. In 1685, the city was \nthe second in France after Bordeaux to have an opera house which was erected on a tennis court. One of \nthe oldest and largest opera houses in France, the elegant Art Deco Opra de Marseille offers a vibrant \nyear-round programme of opera, ballet, concerts and other events.', 1, 1, 1, NULL),
(227, 'Observatoire de Marseille', 'scientific', 'Marseille', 'France', 8, 'Marseille Observatory \nor Observatoire de Marseille or Laboratoire d\'Astrophysique de Marseille is an astronomical observatory \nrun by Aix-Marseille University and the CNRS. It is located in Marseille, France. In its first \nincarnation, it was the discovery site of a group of galaxies known as Stephan\'s Quintet or Hickson 92, \ndiscovered by douard Stephan in 1877.\nThe Marseille Observatory merged with the Laboratoire d\'Astrophysique Spatiale (LAS) c. 2006 to become \nthe Laboratoire d\'Astrophysique de Marseille (LAM) within the Observatoire Astronomique Marseille \nProvence (OAMP). OAMP, then, included Laboratoire d\'Astrophysique de Marseille and Haute-Provence \nObservatory or Observatoire de Haute Provence.', 0, 1, 0, NULL),
(228, 'Muse des Docks Romains', 'scientific', 'Marseille', 'France', 5, 'Marseille has been a \nport of transit since at least the 6th Century BC. But it\'s not often that we find evidence of this. \nThat is why when in 1943 when the Germans were excavating the old port they uncovered the remains of \nthis ancient roman warehouse people became very excited. With the start this was the warehouse to load \nand unload shipments of wine and oil, but also metals and ceramics. Probably the most striking sight is \nof the remains of the hull of an ancient Roman ship. The displays around the excavations tell the story \nof underwater shipwrecks found in the waters of Marseille. ', 1, 1, 0, NULL),
(229, 'Muse Grobet-Labadi', 'scientific', 'Marseille', 'France', 5.5, 'In 1919 the Marie Labadie \ndonated this house and its extensive 13th-19th century art collections over to the city of Marseilles. \nBut more than the precious artwork catches the eye here. The house is a superb example of upscale 19th \ncentury lifestyle in Marseille. It is lavishly appointed and decorated with paintings, sculptures, \nceramics, musical instruments, stained glass, furniture, and wallpaper. Visitors usually havent heard \nof this museum so they go in with few expectations and find themselves utterly taken aback by the \nexquisite delicate artistry of every element of the house. The museum also has a terrific collection of \ndocuments on French and European decorative art.', 1, 1, 0, NULL),
(230, 'Jardin des Vestiges', 'scientific', 'Marseille', 'France', 4, 'The Jardin des Vestiges is \nan archaeological site in Marseille housing the remains of this citys ancient Greek then Roman port.\nDiscovered during building works carried out in the 1960s, the ruins of Jardin des Vestiges have been \nexcavated and include large sections of walls, gates and the remnants of warehouses and the general \ninfrastructure of the old port.\n', 1, 1, 0, NULL),
(231, 'Stade Vlodrome', 'industrial', 'Marseille', 'France', 40, 'The Stade Vlodrome, known for \nsponsorship reasons as the Orange Vlodrome, is a multi-purpose stadium in Marseille, France. It is home \nto the Olympique de Marseille football club of Ligue 1 since it opened in 1937, and was a venue in the \n1998 FIFA World Cup and the 2007 Rugby World Cup. It occasionally hosts RC Toulon rugby club of the Top \n14. It is the largest club football ground in France, with a capacity of 67,344 spectators. The stadium \nis also used regularly by the French rugby union team.', 1, 1, 1, NULL),
(232, 'Les Terrasses du Port', 'industrial', 'Marseille', 'France', 0, 'The Terrasses du Port is a \ncommercial shopping center situated in the 2nd arrondissement of Marseille. The retail format contains \n190 shops, including both domestic and international brands. The mall, which opened in the spring of \n2014 also sports a balcony of 2,600 square meters, offering a view of the port, La Joliette, hence the \nbuilding\'s name, which translates to \"The Port Terraces\".', 1, 1, 1, NULL),
(233, 'Les Docks de la Joliette', 'industrial', 'Marseille', 'France', 0, '', 1, 1, 1, NULL),
(234, 'Bonneveine Mall', 'industrial', 'Marseille', 'France', 0, '', 1, 1, 1, NULL),
(235, 'Dock Des Suds', 'industrial', 'Marseille', 'France', 40, 'Live music venue & nightclub on \nthe site of a former port warehouse, also used for cultural events.', 1, 1, 1, NULL),
(236, 'Flying Tiger Copenhagen Marseille Bourse', 'indutrial', 'Marseille', 'France', 0, 'Flying \nTiger is a Danish design store with a quirky, ever-changing selection of own-designed and branded \nproducts at affordable and rounded prices. Over time, Flying Tigers concept has shifted from cheap to \nunique, from generic to own-designed products, from single to multiple price levels, from a spontaneous \nto a deliberate assortment.', 1, 1, 1, NULL),
(237, 'Parc Borly', 'entertainment', 'Marseille', 'France', 0, 'Parc Borly is a public municipal \npark in the city of Marseille, in France. It is classified by the French Ministry of Culture as one of \nthe Notable Gardens of France. The park is 17 hectares in size. It adjoins the Jardin botanique E.M. \nHeckel.\nParc Borly has three different gardens; a Garden  la franaise, facing the bastide, composed of a two \nlawns, a circular basin and a rectangual basin, and double rows of trees, between the avenue du Prado \nand the gates of the park:\nAn English landscape garden, on the west side of the park, surrounding a lake, and decorated with \nstatues, fountain, a cascade, and a playground. It also features a miniature of the basilica of Notre-\nDame de la Garde.\nA recently renovated race track. The other two parts of the garden connect to the sea by a promenade and \nto the neighboring botanical garden.', 1, 1, 1, NULL),
(238, 'Jardin de la Magalone', 'entertainment', 'Marseille', 'France', 0, 'The Jardin de la \nMagalone is public park and Garden  la franaise in the city of Marseille, France. It is listed by the \nFrench Ministry of Culture as one of the Notable Gardens of France. The garden is 1.4 hectares in size, \nand surrounds an 18th-century bastide, or Provenal manor house. Two terraces, embellished with \nfountains representing the Rhne and the Sane Rivers, separate the house from the garden. The garden is \nlaid out following the principles of a classical French Garden, with parterres, broderie of box wood, \nstatues representing the four seasons, and two basins. rows of tulip tree add to the geometric harmony \nof the garden. The garden is surrounded by a trees, which shield it from the city. separate it the \ncity.', 1, 1, 0, NULL),
(239, 'Parc du 26me Centenaire', 'entertainment', 'Marseille', 'France', 0, 'The park of the 26th \ncentenary (for the 26 00 years of the city) is one of the youngest park in Marseille. It is located near \nthe Place Castellane and was inaugurated on June 23, 2001. This park is built on the grounds of the \nformer Prado station, one can notably see the vestiges of its history: the roof of the old station , The \nrails in the center of the park transformed into a basin with fountains, the terminals of stops of the \ntrains etc.', 1, 1, 1, NULL),
(240, 'Chteau Pastr', 'entertainment', 'Marseille', 'France', 0, 'The Chteau Pastr, formerly \nknown as the Chateau de Montredon, is a nineteenth-century building in the suburb of Montredon to the \nsouth of Marseille, France. Originally the property of a wealthy merchant family, as of 2012 it housed \nthe Faence pottery museum, the Muse de la Faence de Marseille. The grounds of the chateau are a \npublic park.', 1, 1, 1, NULL),
(241, 'TIME OUT Real Escape Game', 'entertainment', 'Marseille', 'France', 27, 'TIME OUT Real \nEscape Game is the first set of scale evasion (escape game in English)  of Southern France  and settled \nin Marseille, downtown, close to the old port since June 2014.\nLocked in a room, you will be confronted with puzzles that only once resolved, will guide you towards \nthe exit. Immersed in a scene, a story, it will depend only on you and your team  to successfully escape \nin less than 60 minutes! \nDecode messages, open chests, find objects ... For this you need to show liveliness, imagination but \nabove duty stick together! \nEvery minute counts!\nTIME OUT Real Escape Game is intended for a wide audience, from 9 to 99 years. From 2 to 6 players , \ncome and meet the challenge in one of our three rooms , in family , between friends or between employees \n. The cost is  25  per person per session. ', 1, 1, 1, NULL),
(242, 'Calanque de Morgiou', 'nature', 'Marseille', 'France', 0, 'The Calanque de Morgiou is one \nof the biggest calanques located between Marseille and Cassis.\nFormerly a fishing port, it is famous for the gigantic tuna fishing organized there in 1622, when the \nking Louis XIII paid a visit to Marseille. It still houses small fishing cabins, but they\'re now used \nfor tourism rather than fishing.\nThe Calanque de Morgiou is also famous for the Cosquer cave, an underwater grotto containing numerous \ncave drawings dating back as far as 27,000 years BP.', 1, 1, 0, NULL),
(243, 'Cosquer Cave', 'nature', 'Marseille', 'France', 11.5, 'The Cosquer cave is located in the \nCalanque de Morgiou in Marseille, France, not very far from Cap Morgiou. The entrance to the cave is \nlocated 37 m (121 ft) underwater, due to the rise of the Mediterranean in Paleolithic times. It was \ndiscovered by diver Henri Cosquer in 1985, but its contents were not made public until 1991, when three \ndivers became lost in the cave and died.', 1, 1, 0, NULL),
(244, 'Mont Puget', 'nature', 'Marseille', 'France', 0, 'Mont Puget, named after the French \nsculptor Pierre Puget, is a mountain, part of Marseille-Cassis calanques, located south-east of \nMarseille. Like most Marseille mountains, it is formed from limestone.', 1, 1, 0, NULL),
(245, 'Calanques National Park', 'nature', 'Marseille', 'France', 11, 'Calanques National Park \n(Parc national des Calanques) sits in the south of France between Marseille and Cassis. The area boasts \ndramatic rocky inlets, azure waters and pebble beaches, making it a popular destination for tourists \nlooking to hike, swim and sail.\nCalanques National Park (Parc national des Calanques) sits in the south of France between Marseille and \nCassis. The area boasts dramatic rocky inlets, azure waters and pebble beaches, making it a popular \ndestination for tourists looking to hike, swim and sail.', 1, 1, 1, NULL),
(246, 'Calanque d\'en Vau', 'nature', 'Marseille', 'France', 40, '', 1, 1, 0, NULL),
(247, 'Parc d\'attractions Magicland', 'themepark', 'Marseille', 'France', 18, 'Seaside family \nattraction with Wild West themed areas, on-site dining & live stunt performances.', 1, 1, 0, NULL),
(248, 'OK Corral', 'themepark', 'Marseille', 'France', 27, 'Family-friendly, Wild West theme park, \nincluding adventure rides, plus cowboy & Indian stunt shows.', 1, 1, 0, NULL),
(249, 'Plages du Prado', 'beach', 'Marseille', 'France', 6, 'Plages du Prado is the generic name \nfor the beaches in the south neighborhood of Marseille, France. The seaside park is an artificial \ncoastal development created in the late 1970s by Gaston Defferre. They were built with the fill coming \nfrom the construction of the two Marseille subway lines.', 1, 1, 0, NULL),
(250, 'Manu Beach New Yorkais', 'beach', 'Marseille', 'France', 19.5, '', 1, 1, 1, NULL),
(251, 'Cathdrale Sainte-Rparate', 'landmark', 'Nice', 'France', 0, 'Nice Cathedral is the \ncathedral of the Diocese of Nice and is located in the old town of Nice in the south of France. It was \nbuilt between 1650 and 1699, the year of its consecration. It is dedicated to the Assumption of the \nVirgin Mary and Saint Reparata.\nIt has been classed as a monument historique since 9 August 1906.', 1, 1, 0, NULL),
(252, 'Notre-Dame de Nice', 'landmark', 'Nice', 'France', 0, 'The Basilica of Notre-Dame de Nice \nis a Roman Catholic Neo-Gothic basilica situated on the Avenue Jean-Mdecin in the centre of Nice, in \nFrance.The basilica, built between 1864 and 1868, was designed by Louis Lenormand and is the largest \nchurch in Nice, but is not the cathedral.\nInspired by Angers Cathedral, it is built in the Gothic style. Its construction was motivated by a \ndesire to frenchify the city after the County of Nice was annexed to France from Italy, and at the time \nGothic buildings were supposed to be characteristically French. Its most prominent features are the two \nsquare towers 65 m high, which dominate the east front together with a large rose window featuring \nscenes of the Assumption of Mary.', 1, 1, 0, NULL),
(253, 'Sainte Jeanne d\'Arc, Nice', 'landmark', 'Nice', 'France', 5, 'The Church of Saint Joan of \nArc is a Roman Catholic parish church located in Nice, France. Noticeable for its original architecture, \nthe church is dedicated to Joan of Arc.\nThe style of this church is controversial among the inhabitants of Nice, judged ugly by some. The church \nis sometime nicknamed \"the Meringue\" for its white color.', 1, 1, 0, NULL),
(254, 'St Nicholas Russian Orthodox Cathedral', 'landmark', 'Nice', 'France', 0, 'The St Nicholas \nOrthodox Cathedral, Nice (French: Cathdrale Orthodoxe Saint-Nicolas de Nice, Russian:  \n, ) is an Eastern Orthodox cathedral located in the French city of Nice. It is recognized as a \nnational monument of France, and it currently belongs to the jurisdiction of the Moscow Patriarchate. It \nis the largest Eastern Orthodox cathedral in Western Europe.\nThe cathedral was opened in 1912, thanks to the generosity of Russia\'s Tsar Nicholas II. From 1931 \nuntil 15 December 2011 (after a longstanding legal dispute over ownership was resolved), the parish that \noccupied the cathedral was part of the Paris-based Patriarchal Exarchate for Orthodox Parishes of \nRussian Tradition in Western Europe under the jurisdiction of the Church of Constantinople. After 2011, \nfollowing a court ruling, the cathedral was transferred to the property of the Russian state, and the \ncongregation came under the jurisdiction of the Russian Orthodox Church.', 1, 1, 0, NULL),
(255, 'Muse National du Sport', 'landmark', 'Nice', 'France', 8, 'The Muse national du Sport is \na national sports museum located in the Grand Stadium of Nice, France.\nThe museum was first established in 1922 by the French minister of war, who held responsibility for \nsports. In the 1940s, the museum fell into desuetude, but was reestablished by the secretary of state \nfor youth and sports in 1963. Architect Roger Taillibert created the galleries inside the Parc des \nPrinces stadium in 1972. The museum moved to 93 Avenue de France in the 13th arrondissement of Paris \nfrom 2008 to 2013, until its relocation in Nice on June 27, 2014.\nToday, the museum contains more than 100,000 items documenting sports from the 16th century to the \npresent, including a fine collection on the history of the modern Olympic Games from 1896. The \ncollections include sports equipment, paintings, sculptures, posters, drawing, philately, advertising, \nbooks, and magazines.', 0, 1, 0, NULL),
(256, 'Musum d\'Histoire Naturelle', 'historical', 'Nice', 'France', 6.5, 'The Natural History \nMuseum of Nice is a French natural-history museum located in Nice.', 1, 1, 0, NULL),
(257, 'Cimetire du Chteau', 'historical', 'Nice', 'France', 4.5, 'The Cimetire du Chteau in \nNice, France, is the burial site for notables such as: Freda Betti (1924-1979), opera singer; Louis \nFeuillade (1873-1925), film director; Alexander Herzen (1812-1870), writer, novelist; Gaston Leroux \n(1868-1927), journalist, novelist; Emil Jellinek-Mercedes (1853-1918); Carolina Otero (1868-1965), \ndancer; Rene Saint-Cyr (1904-2004), actress; Alfred Van Cleef, jeweller.\nThe Cimetire du Chteau stands on the old citadel of Nice. Even today, some sections of the massive \nwalls of the ancient fortress remain. The fortress, which was built in the 16th century, was once one of \nthe most secure strongholds in France. The cemetery is as much popular for its function and history as \nfor the scenic views of the city that affords.\nThe graveyard at Cimetire du Chteau, which was founded in 1783, has 2,800 graves, where some of Nice\'s \nmost famous people lie buried.', 1, 1, 0, NULL),
(258, 'Massena Museum', 'historical', 'Nice', 'France', 8, 'The Muse Matisse in Nice is a \nnational museum devoted to the work of French painter Henri Matisse. It gathers one of the world\'s \nlargest collections of his works, tracing his artistic beginnings and his evolution through his last \nworks. The museum, which opened in 1963, is located in the Villa des Arnes, a seventeenth-century villa \nin the neighborhood of Cimiez.', 1, 1, 0, NULL),
(259, 'Monument aux Morts', 'historical', 'Nice', 'France', 5, 'Monuments aux Morts are French war \nmemorials established to commemorate the losses of World War I. After the end of the 19141918 war there \nwas a frenzy to build memorials to commemorate those who had been killed and it has been calculated that \nin this period well over 36,000 individual memorials where erected throughout France with the majority \nof these being built between 1919 and 1926. These memorials are known as monuments aux morts - literally \nmonuments to the dead and what are known in the United Kingdom as war memorials.', 1, 0, 0, NULL),
(260, 'Muse de Palontologie Humaine de Terra Amata', 'historical', 'Nice', 'France', 12, 'Part \nof Nice\'s archaeological museum dedicated to prehistory, including a discovery trail for kids.', 1, 1, 0, NULL),
(261, 'Muse Matisse', 'artistic', 'Nice', 'France', 12, 'The Matisse Museum is situated on the \nhill of Cimiez, not far from the Franciscan monastery with its Italianate gardens, the Hotel Regina \nwhere Matisse used to reside, and the Gallo-Roman ruins. Since the 5th of January 1963 the Museum has \nbeen welcoming vistors to its collection of works left by the artist (and his heirs) to the city of Nice \nwhere he lived from 1918 until 1954.', 1, 1, 0, NULL),
(262, 'Muse d\'Art Moderne et d\'Art Contemporain (MAMAC)', 'artistic', 'Nice', 'France', 12, 'The Muse d\'art moderne et d\'art contemporain, also known as MAMAC, is a museum dedicated to modern \nart and contemporary art. It opened on 21 June 1990, in Nice, France.', 1, 1, 0, NULL),
(263, 'Muse Marc Chagall', 'artistic', 'Nice', 'France', 9.5, 'The Muse National Marc Chagall \nhouses the largest public collection of of the Russian-born artist\'s seminal paintings of Old Testament \nscenes. Be sure to peek through a plate-glass window across a reflecting pond to view a mosaic of the \nrose window at Metz Cathedral. Chagall (1887  1985) is buried in St-Paul de Vence, a town not far from \nNice.', 1, 1, 0, NULL),
(264, 'Muse des Beaux-Arts de Nice', 'artistic', 'Nice', 'France', 18, 'The Muse des Beaux-Arts \nde Nice in Nice, France at 33 av. des Baumettes was built in the former private mansion built in 1878 by \nthe Ukrainian Princess, Elisabeth Vassilievna Kotschoubey. Named for the artist Jules Chret who lived \nand worked in Nice during his final years, the museum opened as the \"Palais des Arts Jules Chret\" on 7 \nJanuary 1928.\nThe museum houses a collection of art spanning the past four centuries. There are paintings by Chret \nand other artists who lived and worked on the French Riviera such as Gustav-Adolf Mossa (fr), who for \nmany years was curator of the museum. The small museum has sculptures by Jean-Baptiste Carpeaux, \nFranois Rude, Michel de Tarnowsky and Auguste Rodin, plus ceramic pieces by Pablo Picasso.', 1, 1, 0, NULL);
INSERT INTO `Locations` (`LocationID`, `NameLocation`, `TypeLocation`, `City`, `Country`, `Price`, `Description`, `Morning`, `Afternoon`, `Evening`, `LocationImage`) VALUES
(265, 'Muse des Arts Asiatiques', 'artistic', 'Nice', 'France', 0, 'The Guimet Museum (French: \nMuse national des arts asiatiques [MNAAG] or Muse Guimet) is a museum of Asian art located at 6, place \nd\'Ina in the 16th arrondissement of Paris, France. It has one of the largest collections of Asian art \noutside Asia.', 1, 1, 0, NULL),
(266, 'Chapelle de la Misricorde', 'cultural', 'Nice', 'France', 11, 'Considered one of the \nfinest examples of Baroque religious architecture in France, this extraordinary church is almost too \nmuch to absorb in one visit. The building belongs to the Pnitents Noirs brotherhood, a religious \nfraternity established in the 14th century, but its opulent design dates from a few centuries later, \nduring the golden age of the Baroque period (and indeed of the Pnitents Noirs themselves, before the \nintrusion of the French Revolution). The frescoed ceilings, and soaring blue and gold columns create a \ngrand backdrop for more sombre treasures such as Jean Miralhet\'s 15th-century masterpiece La Vierge de \nMisricorde or Louis Bra\'s painting of the same title, finished three decades later in 1485.', 0, 1, 1, NULL),
(267, 'Promenade du Paillon', 'cultural', 'Nice', 'France', 0, 'Nices flagship urban park covers \n12 hectares in the heart of the city, just a few minutes walk from Promenade des Anglais. Promenade du \nPaillon used to be a very congested and rather ugly thoroughfare where the old bus station and multi \nstorey car park were situated. It was demolished in 2011 and a 3 year development project took place to \nturn it into the oasis of green open space, safe play areas and impressive water features that we enjoy \ntoday.', 1, 1, 1, NULL),
(268, ' Vieille Ville', 'cultural', 'Nice', 'France', 0, 'The picturesque Old Town of Nice, with \nits maze of narrow alleyways and cobblestone streets, has a lively ambience reminiscent of Italy. \nPopularly known as \"Babazouk,\" the Vieille Ville begins at the western end of the Colline du Chteau and \nis bounded by spacious boulevards, including the Jardin Albert I, Place Massna, and Promenade du \nPaillon. The southern end of the Old Town borders the Ponchettes where fishmongers and grocers bring \ntheir fresh products to market on the nearby Cours Saleya. The colorful flower market, a traditional \nProvenal event that reflects the richness of Nice\'s daily life, beautifies the street every morning \n(except Mondays). There are also stalls selling soaps, food products, and spices. The market offers all \nthe ingredients necessary to cook the delicious Mediterranean cuisine of the Cte d\'Azur, from Nice \nolives, sheep\'s cheese, and local mushrooms to fresh fish.', 1, 1, 1, NULL),
(269, 'Promenade des Anglais', 'cultural', 'Nice', 'France', 0, 'The most emblematic street in \nNice, the Promenade des Anglais is a gorgeous pedestrian area that follows the curve of the Baie des \nAnges beaches. This legendary seaside road is lined with planted palm trees and filled with elegant \ngardens. Originally just a small footpath, the Promenade des Anglais was developed by Englishman, \nReverend Lewis Way in 1820 at his own expense. It was then called the \"Chemin des Anglais.\" The road was \nfurther enhanced in 1931 when it was given two separate roadways. At the time, Queen Victoria\'s son, \nthe Duke of Connaught, inaugurated the promenade in royal style.\nToday, the road traffic has been diverted with underground tunnels, making the promenade ideal for \npeople to stroll. The Promenade des Anglais is also popular with cyclists and skaters. Since the Belle \nEpoque, it has been graced by opulent buildings such as the Palais de la Mditerrane theater and the \nexquisite Villa Massna (65 Rue de France) palace, once the home of a Princess. Now a historic landmark \nopen to visitors, the Villa Massna houses a museum of art and history and is surrounded by a gorgeous \npark with formal French gardens. Another exceptional building on the promenade is the Le Negresco (37 \npromenade des Anglais), which is listed as a National Historical Monument. Le Negresco is a lavish \nfive-star luxury hotel with a world-class art collection.', 1, 1, 1, NULL),
(270, 'Muse Prieur du Vieux Logis', 'cultural', 'Nice', 'France', 8, 'The Prieur du Vieux-Logis \ninvites you to a journey through time and presents you with collections of medieval religious art and a \nset of usual objects and furniture gathered by the Reverend Dominican Father Alfred Lemerre, enamored of \nancient art. The collections range from the fourteenth to the seventeenth century.', 1, 1, 0, NULL),
(271, 'Cte d\'Azur Observatory', 'scientific', 'Nice', 'France', 8, 'The Cte d\'Azur Observatory \n(Observatoire de la Cte d\'Azur, OCA) originated in 1988 with the merger of two observatories: Nice \nObservatory and Centre de recherches en godynamique et astromtrie (CERGA)', 1, 1, 0, NULL),
(272, 'Thtre de la Photographie et de l\'Image', 'scientific', 'Nice', 'France', 0, 'People who \nwant to discover Nice and its surroundings at a glimpse should definitely visit the so-called Theatre de \nla Photographie et de l\'Image Charles Negre, which is located in the very center of the city, in a \nmajestic building which has managed to preserve much of the charm of the Belle poque period when it was \nbuilt. The venue can easily be classified as a museum of photography, since its mission is to unveil \nNice and the neighboring areas by means of the photographic art.', 1, 1, 0, NULL),
(273, 'The Garibaldi Crypt', 'scientific', 'Nice', 'France', 7, 'Years ago, while jack-hammering \nup Place Garibaldi to lay the rails for the tramway, the workers noticed some strange stone structures \njust 10 centimeters below the asphalt that turned out to be the remains of the ancient city dating back \nto 1380!   Mandated by law to uncover the ruins (and delaying the tramway by a year), the city-sponsored \ndig slowly uncovered the mysteries of a Medieval Nice long-forgotten.  Place Garibaldi, it turns out, \nwas the site of the entry to the walled fortress that was the Chateau, complete with turrets, a moat, a \ndrawbridge, exterior walls, an aqueduct and outbuildings.', 0, 1, 0, NULL),
(274, 'Marineland', 'scientific', 'Nice', 'France', 41.9, 'The Marineland of Antibes is a theme park \nfounded in 1970 by Roland de La Poype in Antibes (Alpes-Maritimes), in the French Riviera. On 26 \nhectares it includes a marine zoological park with dolphinarium, a water park (Aquasplash), a children\'s \nplay park (Kid\'s Island), a mini golf (Aventure Golf) and a three-star hotel (Marineland Resort). It is \nthe property of the Spanish multinational company Parques Reunidos, whose majority shareholder is the \nBritish investment fund Arle Capital Partners. The actual director is Arnaud Palu.', 1, 1, 0, NULL),
(275, 'Nice Etoile', 'industrial', 'Nice', 'France', 0, 'Etoile is a mall French in the heart of \nNice, on the Avenue Jean Mdecin. It has over a hundred shops and five restaurants. Etoile was built on \nthe site of the former Hospice of Charity.', 1, 1, 1, NULL),
(276, 'Centre commercial Nice Lingostire', 'industrial', 'Nice', 'France', 0, 'Nice Lingostire \nis the largest commercial area of the Alpes-Maritimes , located in the west of Nice in the plain of the \nVar .\nIt consists of three areas: a mall with a hypermarket Carrefour and shopping arcade seventy shops, the \nForum Lingostire with a multiplex cinema Path , average areas including La Halle, Darty and a \nveterinary clinic, and a third building grouping of major retailers of DIY as Leroy Merlin .', 1, 1, 1, NULL),
(277, 'TNL', 'industrial', 'Nice', 'France', 0, 'Nice TNL is a mall Nice located in the district \nof Riquier. It consists of a hypermarket Carrefour and a shopping arcade of 60 stores.\nThe center was built on an ancient deposit tramway company Tramway de Nice et du Littoral (TNL), hence \nits name.', 1, 1, 1, NULL),
(278, 'Galeries Lafayette Nice', 'industrial', 'Nice', 'France', 0, 'The Galeries Lafayette is an \nupmarket French department store chain. Its flagship store is on Boulevard Haussmann in the 9th \narrondissement of Paris but it now operates in a number of other locations in France and other \ncountries. In 2009, Galeries Lafayette recorded earnings of over one billion euro. It is a part of the \ncompany Groupe Galeries Lafayette.', 1, 1, 1, NULL),
(279, 'Place du Palais de Justice', 'industrial', 'Nice', 'France', 0, 'Place du Palais de Justice \ndoes not enjoy a high tourist rating only by force of its inner attractions, but also due to the fact it \nbenefits from a virtually central location in Vieux Nice. Hence, it neighbors on tourist sights like the \nvibrant Cours Saleya, the monumental Opera de Nice, the imposing Cathedral of Sainte Reparate, as well \nas on Place Massena. The beaches of Nice are also within reach, accessible by crossing the dreamlike \nQuai des Etats Unis.\nHowever, its vicinities aside, the square is in itself a splendid instantiation of the Neoclassical \nheritage of Nice. The recent restoration works have brought back to life the highlights of the square \nwhich, by far, refer to Palais de Justice (Law Court of Nice) and to the fountain which pegs out the \nplace. The scenery is complemented by the colorful pavement. The monumental staircase of the Law Court \noffers the best lookout from where visitors can admire the view.', 1, 1, 1, NULL),
(280, 'Parc Phnix', 'entertainment', 'Nice', 'France', 5, 'Botanical garden & zoo with huge \ntropical glasshouse, aviaries & habitats for otters & wallabies.', 1, 1, 0, NULL),
(281, 'Casino Du Palais De La Mditerrane', 'entertainment', 'Nice', 'France', 50, 'Casino table \ngames & slots, plus musical & comedy cabaret in this white-stucco, Belle Epoque palace.', 1, 1, 1, NULL),
(282, 'Jardin d\'Oiseaux Tropicaux', 'entertainment', 'Nice', 'France', 13, 'The Jardin d\'Oiseaux \nTropicaux (6 hectares) is an aviary and botanical garden located on the Route de Valcros, La Londe-les-\nMaures, Var, Provence-Alpes-Cte d\'Azur, France. It is open daily; an admission fee is charged.\nThe garden was established in 1989 and in 2008 was designated a Jardin Remarquable by the Ministre de \nla Culture et de la Communication. It contains about 450 tropical birds representing 80 species from \nAsia, Africa, and South America, with notable collections of curassows, hornbills, kookaburras, parrots \nand parakeets, pigeons, and touracos. Its landscaped gardens contain national collections of agaves \n(more than 100 taxa) and yuccas (more than 40 taxa), as well as palm trees.\nThis garden is now called Jardin zoologique tropical.', 1, 1, 0, NULL),
(283, 'Wayne\'s Bar', 'entertainment', 'Nice', 'France', 15, 'Waynes Bar the home of live music in \nNice Situated in the heart of the old town Waynes Bar is the busiest bar on the Riviera. Waynes Bar \nestablished in 1991 and still going strong, come and witness it for your self. World famous party times \nand amazing live music every night of the week!', 1, 1, 1, NULL),
(284, 'Thtre National de Nice', 'entertainment', 'Nice', 'France', 26, 'National theatre in \nNice, France', 1, 1, 1, NULL),
(285, 'Castle of Nice', 'nature', 'Nice', 'France', 0, 'The Castle of Nice was a citadel used for \nmilitary purposes. Built at the top of a hill, it stood overlooking the bay of Nice from the 11th \ncentury to the 18th century. It was besieged several times, especially in 1543 and in 1691, before it \nwas taken by French troops in 1705 and finally destroyed in 1706 by command of Louis XIV.\nNowadays, Castle Hill is used as a park. It\'s the most famous public garden in Nice, and a \"must see\" \nplace for the numerous tourists who visit the city. It offers many amazing panoramas, and provides a \nbeautiful view all day long from sunrise to sundown, highlighting various landscapes depending on where \none looks: the Harbor at sunrise, the Promenade des Anglais at sundown. That\'s why Castle Hill is \ncalled \"the cradle of the sun\".', 1, 1, 1, NULL),
(286, 'Jardin Albert I', 'nature', 'Nice', 'France', 0, 'The Albert I Garden neighbors on Place \nMassena, a short walk north from Promenade des Anglais, in the very center of the city, and it is one of \nthe best places where people can spend their leisure time in Nice. The park was set up in 1914 and its \nopening was attended to by Albert I, King of Belgium. The garden is dotted with palm trees and other \nspecies of trees which cast a refreshing shadow on the meandering alleys of the park.\nThe large central lawn is marked by the monumental Arc de Venet (work of Bernard Venet), which amounts \nto 19 meters in length and was inaugurated in 1988. Jardin Albert I is also pegged out by a series of \nfountains and basins, of which the most spectacular refers to the Tritons\' Fountain, a landmark \nbestowed with the title of historical monument in 1920.', 1, 1, 1, NULL),
(287, 'Jardin botanique de la Ville de Nice', 'nature', 'Nice', 'France', 0, 'A trip to the heart \nof the Mediterranean.\nIt allows visitors to familiarize themselves with the plant world and has a mission to conserve \nbiodiversity and transmit natural heritage.\nA veritable open-air museum, this unique garden presents a wide range of plants, declined in 40 zones, \nreconstituting natural environments. Walk and discovery park, this municipal park created in 1983 \npresents more than 3,000 plant species on 3.5 hectares.\nIt also offers a remarkable view of the mouth of the Var and the Baie des Anges. Come to discover this \nexceptional site whose originality encourages you to travel through the reconstruction of Mediterranean \nlandscapes.', 1, 1, 0, NULL),
(288, 'Parc de la Colline du Chteau', 'nature', 'Nice', 'France', 8, '', 1, 1, 0, NULL),
(289, 'Pyramide de Falicon', 'nature', 'Nice', 'France', 0, 'The Falicon pyramid is a monument \nlocated at a rural site near the town of Falicon, on the French Riviera, near Nice.\nIt is constructed above a karstic cave known as the Cave of the Bats (Occitan: Bauma des Ratapignata) \nand is one of the few pyramids in Europe. The pyramid is constructed of small, irregularly shaped \nstones, possesses a fairly acute angle of inclination, and is in a partly ruined condition. While most \nof its upper section is missing, the lower section is reasonably well preserved.\nThe pyramid\'s purpose and exact origins are unknown. Though it had been suggested that it may have been \nconstructed by Roman legionaries involved in Egyptian cult practices, more recent research indicated \nthat it was actually built between 1803 and 1812, i.e. during the rule of Napoleon Bonaparte.', 1, 1, 0, NULL),
(290, 'Antibes Land', 'themepark', 'Nice', 'France', 15, '', 1, 1, 0, NULL),
(291, 'Le Bois des Lutins', 'themepark', 'Nice', 'France', 17, '', 1, 1, 0, NULL),
(292, 'Voilier Plage', 'beach', 'Nice', 'France', 20, 'Le Voilier Plage, situated on Nice\'s famous \nPromenade des Anglais, is the classiest beach on which to relax in Nice. This modern and refined beach \ngives you all you would want from a relaxed day at the beach. Furthermore, the modern vibe of the \nprivate beach brings about a sense of quality. The hardworking staff pay attention to every detail to \nmake sure that your beach experience is one of class, quality and luxury so that you can completely \nrelax and enjoy your free time.', 1, 1, 0, NULL);
